ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2162', '96', '2019-05-10 09:02:35', '2019-05-10 09:02:35', 'Ürək ritmlərini ölçən ağıllı üzük hazırlanıb', '\r\n<p><strong>Chip.az</strong><span> </span>xəbər verir ki, tədqiqatçılar üzüklərin yaxın vaxtlarda ürək döyüntülərinin normal olub-olmadığını təyin etmək üçün istifadə edilə biləcəyinə ümid edirlər.</p>\r\n<p>Bu həftə keçirilən  “Heart Rhythm” dərnəyinin elmi sessiyalarında təqdim edilən araşdırmada ürək ritmləri pozulan 119 xəstədə  eyni zamanda EKQ-lər və optik sensor əsaslı fotopletismografiler qarşılaşdırılıb. Tədqiqatçılar faktiki təsnifat üçün ortalama təhlükəsizlik səviyyəsinin 98,6% olduğunu qeyd ediblər.</p>\r\n<p>Seul Milli Universitet Xəstəxanasının kardioloji professoru Eue-Keun Choi dəqiqliklə öyrənmə alqoritminin yeni hazırlanan “ağıllı” üzük vasitəsi ilə günlük aktivlik dərəcəsinin təyin etmək istədiklərini, tibbi cəhətdən isə üzüyün ürək ritmlərini qeyd etməsi üçün də istifadə olunmasına ümid etdiklərini vurğulayıb.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/06d34749fef220be9befebca155ee5051eb54c8b.jpeg\" /></p>\r\n<p>Ağıllı saatların gündəlik və ya həftəlik  batereya ilə təmin edilməsi probleminin mövcudluğu baxımdan sözü gedən üzüklərin ürək ritmlərini daimi qeyd etməsinin mümkün olmayacağı düşünülür. Ancaq ağıllı saatların ekran, qabaqcıl prosessor və bildirişlər kimi funksiyalarının üzükdə istifadə olunmamamsı bu problemi aradan qaldıracaq. Üzüklərin <span>ürək ritmlərini qeydə alan </span>böyük və çox bahalı cihazlara rəqib olacağı gözlənilir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'urek-ritmlerini-olcen-agilli-uzuk-hazirlanib', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/10\\/y.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2163', '111', '2019-05-10 10:20:31', '2019-05-10 10:20:31', 'Azərbaycanda  yeni onlayn radio stansiyası fəaliyyətə başlayıb', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, yeni onlayn radio stansiya “LIVE AND DIGITAL” tərəfindən yaradılıb. <a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fwww.liveanddigital.net%2F%3Ffbclid%3DIwAR1rKvQJ6syeAq5K_ZeDWambD96JrVadJj5hxIacZ6MEGUDQP03hR6A9xX8&amp;h=AT2N5lOOZ8A8wL8ToQXgF_jWhwKcpYmFw7gWqyOIwb6tOfv_emupyTl6DZhQxjESHm8DySjDPHANLQzOF-4z3D8334taJ33K0RBVmUxeD-yPXtABryK7rpZ_RwMUpDbz6bYh\">https://www.liveanddigital.net/</a>. “LIVE AND DIGITAL” dinləyicilərə yerli və beynəlxalq DJ və musiqiçilərin canlı çıxışları ilə yanaşı fәrqli janrlarda musiqi seçimini təqdim edir. Radionun tәsisçisi bəstəkar, musiqi prodüseri Anar Yusufov (Anar Keytarman) bildirib ki, radio yaratma ideyası onda təsadüfən yaranıb:</p>\r\n<p>\"Öz studiyamın ətrafına baxdım və İnternet radio stansiyasını yaratmaq üçün hər şeyin olduğunu başa düşdüm\" deyə  Anar Yusufov qeyd edib.<br /> </p>\r\n<p>“LIVE AND DIGITAL”da başqa radiostansiyalarda olmayan musiqilər səsləndiriləcək. Ölkəmizdə FM bandı təxminən eyni formatda,eyni musiqi yayımlayan müxtəlif radio stansiyaları ilə doludur. Radio elektron, caz, və digər musiqi dinləyicilərinin zövqünә oxşuyacaq. Bakıda çoxlu sayda istedadlı musiqiçilər, DJ-lər, ayrıca fәaliyyәt göstәrәn elektron musiqi ifaçıları var. Beləliklə “LIVE AND DİGİTAL” janrdan və yaşdan asılı olmayaraq istənilən musiqi parçalarının yayımlana bilәcәyi platforma olacaq. “LIVE AND DİGİTAL” yalnız musiqi, sənətinə yönəldən, musiqiçilərin format məhdudiyyətləri ilə qarşılaşmayacağı və mövcud standartlardan kənar radio stansiyadır. </p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>\r\n<p> </p>', 'azerbaycanda-yeni-onlayn-radio-stansiyasi-fealiyyete-baslayib', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/10\\/lll.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
