ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2165', '96', '2019-05-10 11:26:02', '2019-05-10 11:26:02', 'Naviqasiya düymələrı bütün cihazlarda eyniləşdiriləcək', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Android Q” ilə bu xüsusiyyət \"standart\" hala gətirilir. Bu istiqamətdə “Google” əsas telefon istehsalçıları ilə birlikdə işləyərək yeni bir naviqasiya çubuğu hazırlayıb. “Android Q” istifadəçiləri  bu çubuğun köməyi ilə tətbiqlər arasında keçid edə və əsas ekran menyusuna birbaşa daxil ola biləcəklər.</p>\r\n<p>“Google”un idarəçilərindən olan Allen Huang yenilənmiş naviqasiya çubuğu haqqında bəzi açıqlamalar verib. Naviqasiya çubuğunun istifadəçilər üçün daha səmərəli olacağını qeyd edərək vasitənin “Android”ə uyğun formada hazırlandığını bildirib.</p>\r\n<p><img src=\"https://foto.sondakika.com/haber/2019/05/10/android-q-ile-tum-cihazlardaki-navigasyon-tus-12032868_o.jpg\" alt=\"Android Q ile Tüm Cihazlardaki Navigasyon Tuşları Standart Hale Gelecek, System.String[]\" /></p>\r\n<p>Bildiyiniz kimi Android telefonlarında mövcud olan naviqasiya çubuğu “Android Q” ilə müqayisədə fərqli və müxtəlifdir. Huang  bu baxımdan istifadəçilərin alışqanlıqlarını dəyişdirməyin doğru olmadığını və bu dəyişikliyin “Android” lərə heç bir təsir göstərməyəcəyini ifadə edib:</p>\r\n<p>“Əgər Android Q əməliyyat sisteminizi yeniləyərək istifadə etsəniz heç bir dəyişiklik olmadığını görəcəksiniz. Lakin Android Q əməliyyat sisteminə sahib olan yeni bir telefon alsanız parametrlər bölməsindən onu istifadə etmək istəyinizə uyğun olaraq düzəldə bilərsiniz”</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>\r\n<p><strong> </strong></p>', 'naviqasiya-duymeleri-butun-cihazlarda-eynilesdirilecek', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/10\\/android-q-ile-tum-cihazlardaki-navigasyon-tus-2-12032868_o.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2166', '96', '2019-05-10 12:24:18', '2019-05-10 12:24:18', 'Amazon Aya yeni vasitə göndərəcək', '\r\n<p><strong>Chip.az </strong>xəbər verir ki, \"Amazon\"un yaradıcısı və dünyadakı ən zəngin adamı Jeff Bezos tərəfindən qurulan “Blue Origin” şirkəti həyata keçirdiyi layihələri və sərmayələri ilə “SpaceX”in rəqibinə çevrildi.</p>\r\n<p>Blue Origin ötən axşam çox əhəmiyyətli açıqlama verib. Belə ki, şirkət ilk dəfə olaraq ayın səthinə göndərmək istədiyi yeni kosmik “Blue Moon” modelinin real ölçülü modelini nümayiş etdirib. “Blue Origin”in məqsədi 2024-cü ilə qədər ayın səthinə enmək və orada daimi qalmaqdır.</p>\r\n<p>Şirkətin təsisçisi Jeff Bezosun sözlərinə görə, “Blue Origin\"nin daha böyük versiyalarından astronomları aya çatdırmaq, yük daşınması və ayın səthini araşdırmaq məqsədi ilə dörd kəşfiyyat vasitəsini gətirmək üçün istifadə olunması nəzərdə tutulub. Bir sözlə sözü gedən vasitənin əhəmiyyəti olduqca böyük olacaq.</p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n<p>Bundan başqa təqdimetmə mərasimində Ay kəşflərində istifadə olunacaq kəşfiyyat vasitələri üçün  konsept modelini və nəqliyyat vasitələrində yerləşdiriləcək BE-7 mühərriki nümayiş olunub.</p>\r\n<p>“CNN International”un məlumatına görə şirkət son üç ildə bu layihənin üzərində işləyirdi.</p>\r\n<p>Hazırda “Blue Moon” layihəsi ilə bağlı vacib nüanslardan biri bu texnologiyaların vaxtında təslim edilməsidir.  “Biz aya geri dönməli və orada qalmalıyıq”-deyə bildirən Bezos ilk olaraq keyfiyyətli raketə, ərazi vasitəsinə və digər lazımi resurslara ehtiyac olduğunu  vurğulayıb.</p>\r\n<p><iframe width=\"560\" height=\"314\" src=\"//www.youtube.com/embed/hmk1oHzvNKA\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'amazon-aya-yeni-vasite-gonderecek', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/10\\/jeff-bezos-blue-origin-in-ay-a-gonderilecek-s-12032867_o.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
