ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2168', '96', '2019-05-10 13:06:07', '2019-05-10 13:06:07', 'Real TV-nin yerüstü yayımına başlanılıb', '\r\n<p><span><strong>Chip.az</strong> xəbər verir ki, sözügedən qərara uyğun olaraq, Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyinin Radio Televiziya yayımı və Peyk rabitəsi İstehsalat Birliyinin (Teleradio İB) respublika ərazisində fəaliyyət göstərən radio-televiziya yayım stansiyaları vasitəsilə, o cümlədən Bakı şəhəri və Abşeron yarımadası ərazisində 48-ci TV kanalda SD, 37-ci TV kanalda isə HD formatında Real TV proqramının DVB-T standartında yerüstü yayımına başlanılıb.</span><br /><br /><span>Buna qədər isə MTRŞ-in müvafiq qərarına əsasən, \"Real Təhlil İnformasiya Mərkəzi\" MMC-yə ixtisaslaşmış proqram kimi peyk yayımı üçün müddətsiz lisenziya verilmiş və bunun əsasında Teleradio İB-nin Bakı Teleqüllə Kompleksinin yerüstü peyk stansiyası üzərindən ötürülməklə, Real TV proqramının 11135 MHs tezlikdə \"Azerspace-1\" peykindən SD formatlı yayımı təmin olunmuşdu.</span><br /><br /><span>Hazırda Teleradio İB tərəfindən Real TV proqramının paralel olaraq yerüstü, peyk və İPTV üzərindən yayımı aparılır.</span></p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'real-tv-nin-yerustu-yayimina-baslanilib', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email