ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2169', '96', '2019-05-10 13:27:34', '2019-05-10 13:27:34', 'Məşhur tozsoran şirkəti avtomobil istehsalına hazırlaşır', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, ilk olaraq  2016-cı ildə elektrik enerjisi ilə çalışacaq avtomobillər haqqında yayılan məlumatlar 2017-ci ildə öz təsdiqini tapdı. Beləliklə şirkətin elektrik mühərrikinə malik olacaq avtomobil istehsalı üçün patent aldığı məlum olur. Bu patentin 3D modelləşdirilməsi nəticəsində formalaşan nəqliyyat vasitəsinin görüntüləri yayımlanıb.</p>\r\n<p> <img src=\"https://www.webtekno.com/images/editor/default/0002/02/e56202997f7de89816b9e640fb629ebbf6b356f5.jpeg\" /></p>\r\n<p>Vasitənin yüksək və həcmli bir dizayna malik olması məhsula xüsusi maraq yaradır. Crossover seqmentli olacağı düşünülən avtomobilin diqqət çəkən diər özəlliyi çox kəskin xəttlərə sahib olmasıdır.</p>\r\n<p>Qeyd edək ki, batareya şirkəti “Sakti3”ü 90 milyon dolar qarşılığında satın alan “Dyson”  batareya istehsal edəcəyini bildirmişdi. Bu avtomobil üçün də üretimi təxminən 3.25 milyon dolar investisiya ayıran şirkətin mövcud sektorda hansı mövqeyi tutacağı maraqla gözlənilir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'meshur-tozsoran-sirketi-avtomobil-istehsalina-hazirlasir', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/10\\/f2ed37c8790f59535f9e593d50ba663126fdf7bd.jpeg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2170', '96', '2019-05-11 05:40:23', '2019-05-11 05:40:23', 'Elon Musk Amazon-un hazırladığı yeni cihazına ciddi yanaşmır', '\r\n<p><strong>Chip.az</strong> xəbər verir ki,bir müddət əvvəl  Musk “Amazon” təmsilçisinin  internet əlaqələri üçün kosmosa 3 min peyk göndərmək istəyi ilə bağlı  “Twitter” üzərindən Bezosu “təqlidçi” adlandırmışdı. Elon Musk bu dəfə də Bezosun Aya göndərmək istədiyi “Blue Moon” haqqında paylaşım edib.</p>\r\n<p>Jeff Bezosa məxsus “Blue Origin” və Elon Muskun  “SpaceX” şirkətləri mövcud sektorda xüsusi rəqabətə sahibdirlər. Elon Muskun  \"Blue Moon\" haqqında söylədiyi fikirlər də bu rəqbətdən qaynaqlanır. Hər iki şirkət ay və Marsa getməyi planlaşdıraraq, təkrar istifadə edilə bilən raketləri istehsal edir.</p>\r\n<p><img src=\"https://cdn.webtekno.com/media/cache/content_detail_v2/article/68382/elon-musk-twitter-dan-jeff-bezos-a-salladi-alay-etmeyi-birak-1557490031.jpg\" alt=\"Elon Musk, Twitter’dan Jeff Bezos’a Salladı: Alay Etmeyi Bırak Jeff\" /></p>\r\n<p>Musk  bu haqqda yayımlanan xəbərə ironik zarafat əlavə edərək sosial şəbəkədə paylaşıb.</p>\r\n<p><em><strong>“Jeff, bizi güldürməkdən vaz keç ”</strong></em></p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n<p>Bezos əvvəllər olduğu kimi Elon Muska cavab verməyib. “Space X”in rəhbərinin sosial platformadakı atmacalarına “Blue Moon” sahibi  son dövrlərdəki yenilikləri ilə meydan oxumağı üstün tutur.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong> </p>\r\n<p> </p>', 'elon-musk-amazon-un-hazirladigi-yeni-cihazina-ciddi-yanasmir', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/11\\/ELON.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2171', '96', '2019-05-11 07:25:14', '2019-05-11 07:25:14', 'NASA şişirdilmiş robotlar üzərində işləyir', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, burada təcrübəçi kimi işləyən Chuck Sullivan və Jack Fitzpatrick 3D formatını tətbiq edərək həm yumşaq, həm də şişirdilmiş robot hissələri istehsal etməyə müvəffəq oldular. İstehsal olunan hissələrin qəlibləri 3D printerlərdən əldə edilir və daha sonra onlar elastik silikonların köməyi ilə tamamlanır.</p>\r\n<p>Yumşaq və şişirilmiş robotlar hazırlanmasının səbəbi isə yumşaq materialların kosmik şəraitə daha tez uyğunlaşmasıdır. Onlar orqanizmlərə bənzər bir şəkildə hərəkət edə bilər və mürəkkəb quruluşa malik nöqtələrə gedə bilirlər. Bu yolla yumşaq robotların hərəkət trayektoriyaları genişlənir və daha ətraflı araşdırma aparmaq mümkün olur. Ancaq bu robot hissələri hələki kosmosda  istifadə oluna biləcək səviyyədə deyillər.</p>\r\n<p>Tədqiqatçıların bu qəlibləri dörd müxtəlif istiqamətdə inkişaf etdirməlidir. Bu məsələlər hərəkət, düzəltmək, birləşdirmək və formalaşdırmaq mərhələlərindən ibarətdir. Robotlara aid bu hissələr qəliblər sayəsində hərəkət edərək lazım olduqda əyilə və əvvəlki halına qayıda bilər. Bu layihənin ən çətin məqamları buhissələri bir araya gətirməkdir. Qəliblər istehsal edildikdən sonra birləşdirilməsi lazımdır. Daha sonra kosmik kəşfiyyatda istifadə edilmək üçün münasib olacaq. Tədqiqatçılar bu problemi həll etməyə çalışırlar. Əgər bu alınarsa kosmosda robotların köməyi ilə müvəqqəti sığınacaqlar quraşdırıla bilər.</p>\r\n<p>NASA bu yumşaq robotun parçalarını daha əlverişli formaya salmaq üçün ölkənin hər yerində robot ekspertləri və digər tədqiqatçıları Langley tədqiqat mərkəzində dəvət edir. Bu eyni zamanda işləri sürətləndirmək məqsədi daşıyır.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'nasa-sisirdilmis-robotlar-uzerinde-isleyir', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/11\\/news_d4ac6b56fa9ebbb27baf657e30ebd0fd.gif\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2172', '96', '2019-05-11 08:00:31', '2019-05-11 08:00:31', 'Süni intellekt 20 il gizlənən cinayətkarı tutmağa kömək edib', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, cinayətkarın tutulması və törətdiyi əməl barədə ətraflı məlumat verilməsə də, şirkət nümayəndələri texnologiya vasitəsilə artıq 100-dən çox şübhəli şəxsin saxlanıldığını bildiriblər. \"DeepGlint Technology\" əməkdaşlarının sözlərinə görə, sistem insan gözü strukturuna əsaslanır və kameraların köməyi ilə 50 metr məsafədən insan və nəqliyyat vasitələrini fərqləndirə bilir. Şübhəli hərəkətlər aşkarlanan zaman dərhal bildiriş alan hüquq-mühafizə orqanları tərəfindən vəziyyətə müvafiq reaksiya göstərilir.</p>\r\n<p>Bildirilir ki, Çində sifətin tanınması sistemləri cinayətkarların axtarışı ilə yanaşı, qayda pozuntularının aşkarlanması məqsədilə vətəndaşların davranışının izlənilməsi üçün aktiv istifadə edilir. Bu, ideal cəmiyyət yaratmaq məqsədi daşıyan vahid sosial reytinq sisteminin tərkib hissəsini təşkil edir. Bu yaxınlarda texnologiyanın tətbiqinin ilkin nəticələri məlum olub.</p>\r\n<p><iframe width=\"560\" height=\"314\" src=\"//www.youtube.com/embed/xhp47v5OBXQ\" allowfullscreen=\"allowfullscreen\"></iframe></p>', 'suni-intellekt-20-il-gizlenen-cinayetkari-tutmaga-komek-edib', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/11\\/1505289472194692011_1000x669.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2173', '96', '2019-05-11 08:39:39', '2019-05-11 08:39:39', 'Adobe köhnə versiyalardan istifadəni məhdudlaşdırır', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, istifadəçiləri sevindirən bu yenilik  məhdud çərçivədə tətbiq olunub. Belə ki, “Adobe CC” köhnə versiyaların müəyyən qismindən istifadəyə icazə verir.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/f5e012f57bbfdd58f3d2171608c177b7beca3d93.jpeg\" /></p>\r\n<p>Hər bir tətbiq üçün müxtəlif versiyaları çıxaran “Adobe CC”nin əsas məqsədi istifadəçilərin tələblərini daha dəqiq şəkildə qarşılamaqdır. Bununla bərabər “Photoshop” və “Lightroom”  tətbiqlərinin son iki böyük versiyalarından daha öncə yayımlanan bütün versiyaları aradan qaldırılıb.</p>\r\n<p>“Adobe” proqramlarını aktiv şəkildə istifadə edirsinizsə və köhnə versiyalardan məlumatınız yoxdursa “Creative Cloud”da  \"Proqramlar\" bölməsindən \"Digər versiyalar\" ı seçə bilərsiniz. Bu yolla proqramın bütün köhnə versiyalarını görə bilərsiniz.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'adobe-kohne-versiyalardan-istifadeni-mehdudlasdirir', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"a