rd\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2178', '96', '2019-05-13 08:14:32', '2019-05-13 08:14:32', 'Google İphone ilə zarafat etdi', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, şirkətin \"Pixel\" seriyası üst seqment məhsulu kimi bazara təqdim olunur. Eyni zamanda “iPhone”ə yaxın qiymətdə təklif olunur.  Hazırda bazara büdcə dostu “Pixel” telefonunu təklif edən “Google”  “Apple” şirkətinə müraciət etməkdən çəkinməyib.</p>\r\n<p>\"Google\" reklam lövhəsində, “PhoneX” sözünün aşağısında 999 dollar yazaraq “Apple”a müraciət ünvanlayıb. Bu mətnin alt tərəfində isə 399 dollarlıq “Pixel 3a” yer alır. Beləliklə 999 dollarlıq “iPhone-X”in kamerası qaranlıq şəkillər çəkərkən, 399 dollar “Pixel 3a”nın kamerası daha dəqiq fotoşəkillər çəkə bilməsi qeyd oluinub .</p>\r\n<p>“Pixel 3a” ən böyük satış strategiyasını üst seqmentə məxsus telefonlarını daha sərfəli qiymətə  təklif edərək həyata keçirir. </p>\r\n<p>Qeyd edək ki, “Google”  bu reklamı “Apple” sevərlərin “Pixel 3a”nın şəkil çəkmək keyfiyyətinin geridə qalması barədə  sosial mediadakı  paylaşımından sonra yayımlayıb.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'google-iphone-ile-zarafat-etdi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/13\\/803cdc925c01a157983124d94acc536404247be4.jpeg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2179', '96', '2019-05-13 09:07:30', '2019-05-13 09:07:30', 'PS-4 üçün hazırlanan oyun ləğv edildi', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Sony Santa Monica” Studiyası 2019-cu ildə BAFTA mükafatlarında“Ən Yaxşı Oyun” mükafatına layiq görülən “God of War”ın istehsalçısı olaraq tanınır. Studiya bu əfsanənin təqdim olunmasına yaxın başqa bir oyun üzərində də çalışırdı. Bu oyun şirkətin əvvəllər qarşılaşmadığı dərəcədə çətin və fərqli idi. Bununla da layihəyə yekun verilmədən ləğv edildi.</p>\r\n<p>Bu layihənin kodu “Internal-7” idi. 3 il müddətində təkmilləşdirilən elmi fantastika oyunu “Internal-7” xüsusi olaraq PS-4 üçün təqdim olunacaqdı. Ancaq gözlənilmədən layihə dayandırıldı.  Prosesin gedişatı müddətində oyun üzərində işləyən bir çox şəxs öz işini itirdi.</p>\r\n<p>“Sony Santa Monica” studiyasının “Raising Kratos” adlı yeni “God of War” sənədli filmi haqqında daha ətraflı məlumat elan olunub.  Beləliklə “Internal-7”  ləğv edildikdən sonra 100-dən çox şəxs bu komandaya əlavə olunub.</p>\r\n<p>“Sony Santa Monica” nın prezidenti Shanon Studstill “Internal-7” ni “Sony”nin “itirilmiş arzu”  olaraq təsvir edir. Görünən odur ki, komandanın bu oyuna böyük ümidləri varmış.</p>\r\n<p>Studiyanın “YouTube” kanalında “God of War”ın inkişaf prosesini  əks etdirən sənədli filmdə “Internal-7” yə aid konseptual hissələr də yer alır.</p>\r\n<p>Həmin filmin 08: 59-cu dəqiqəsini izləsəniz bunu seyr edə bilərsiniz:</p>\r\n<p><iframe width=\"560\" height=\"314\" src=\"//www.youtube.com/embed/lJZWKBDXXFY\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'ps-4-ucun-hazirlanan-oyun-legv-edildi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/13\\/1632513.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2180', '96', '2019-05-13 10:49:34', '2019-05-13 10:49:34', ' MTRŞ Azərbaycanda ilk dəfə rəqəmli radio yayımı üçün diapazon ayırdı', '<strong></strong></div>\r\n<div> </div>\r\n<div><strong>Chip.az</strong> xəbər verir ki, bu barədə  MTRŞ-nin şöbə müdiri İsa Məmmədov məlumat verib.  </div>\r\n<div> </div>\r\n<div>O bildirib ki, bu yayım zamanı 12 radio proqramı Bakı şəhəri və Abşeron yarımadası ərazisində təxminən 256 kbit/san sürəti ilə stereo formatında yayımlanacaq: \"Bundan başqa, titrlər formasında əlavə məlumatların (dataların) verilməsi də nəzərdə tutulur. Nəqliyyat, Rabitə və Yüksək Texnologiyaları Nazirliyinin \"Teleradio” İstehsalat Birliyi bu yayımı həyata keçirmək üçün 1 kVt gücündə olan radiovericini istismara verəcək. Radiovericinin əhatə zonası təxminən 80-90 km olacaq”. </div>\r\n<div> </div>\r\n<div>İ. Məmmədov qeyd edib ki, Avropa ölkələrinin əksəriyyətində DAB və ya DAB+ standartlı rəqəmli radio yayım həyata keçirilir: \"DVB-T standartı üzrə rəqəmli radio yayımının aparılması isə o qədər də effektli sayıla bilməz. Çünki bunu yalnız DVB-T televiziya qəbulediciləri dəstəkləyə bilir. Lakin, Norveçdən başqa, bütün ölkələrdə bu yayım analoq radio yayımı ilə paralel aparılır. Bizim ölkəmizdə də hələlik analoq radio yayımının dayandırılması gündəlikdə yoxdur”.</div>\r\n<div style=\"text-align: right;\"></div>\r\n<div style=\"text-align: right;\"><strong>Chip.az</strong></div>', 'mtrs-azerbaycanda-ilk-defe-reqemli-radio-yayimi-ucun-diapazon-ayirdi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\