ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2183', '96', '2019-05-13 12:55:39', '2019-05-13 12:55:39', 'Instagram Ramazan ayı münasibəti ilə xüsusi effekt yaradıb', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, xüsusilə Ramazan ayı üçün yaradılan bu effekt #MonthofGood (#Yaxşılıqayı) başlığı ilə istifadəyə verilib. İstifadəçilər Ramazan coşğusunu bu yeniliklə bərabər sosial aləmdə paylaşa bilərlər.</p>\r\n<p>“Instagram”ın Türkiyə Strateji Ortaq İdarəçisi Samer Jamal adı çəkilən sosial şəbəkə qlobal platforma olduğuna görə burada hər mədəniyyətə mənsub istifadəçilərin olduğunu qeyd edib. Əlavə olaraq Ramazan ayında istifadəçilərin yaxşı diləklərini  bu şəbəkə üzərindən tez-tez paylaşdıqlarını vurğulayıb.</p>\r\n<p>“Ramazan ayı yaxşılıq ayıdır. Yaxşılığın böyüklüyü və ya kiçik olması bir o qədər də əhəmiyyətli deyil. Ən vacibi bu yaxşılığı bir şəkildə göstərməkdir \"deyən Samer Jamal kampaniyanın Ramazan ayının sonuna qədər davam edəcəyini söyləyib.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/63181038f7368f1c500e17709c7effbf272a2a85.jpeg\" /></p>\r\n<p>Qeyd edək ki, sözü gedən yenilikdən istifadə etmək üçün “hekayə əlavə et” bölməsinə daxil olaraq Ramazan ayı olan effektini  seçmək tələb olunur.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'instagram-ramazan-ayi-munasibeti-ile-xususi-effekt-yaradib', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/13\\/instagram-ramazan-ayina-ozel-kamera-efekti-olusturdu-1557742182.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2184', '96', '2019-05-13 13:10:58', '2019-05-13 13:10:58', 'Bently-ni tank kimi istifadə etdilər', '\r\n<p>Milyon dollarlar dəyərində “ Bently Continental GT”ni  də palet taxılan bir ərazi vasitəsi kimi burada görə bilərsiniz.</p>\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Ultratank” adlandırılan bu maraqlı vasitənin gövdəsi, daxili dizaynı və hətta mühərriki belə “Bently”ə məxsusdur. Sözü gedən vasitəni  fərqləndirən özəllik isə avtomobilin kənarından çıxan çoxfunksiyalı paletlərdir.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/bf86eb929fd3266e91535f2dc39ec75874b581ab.jpeg\" /></p>\r\n<p>Avtomobilin cari maksimum sürəti saatda 50 kilometrdir. Lakin vasitəni hazırlayanlar 100 km / saata qədər maksimum sürətini artırmağı planlaşdırırlar. Bu əsl “Continental GT”dən gözlənilən sürət olmaya bilər. Ancaq bu vasitənin yağlı asfaltda istifadə olunmayacağını unutmayın.</p>\r\n<p>“Ultratank Bently Continental GT” təkcə tozlu və dik ərazilərdə sürüş hissini yaratmır. Avtomobilin inanılmaz mühərrik səsi sanki ikinci dünya müharibəısindən qalan tank səsini çıxarır.</p>\r\n<p><iframe width=\"560\" height=\"314\" src=\"//www.youtube.com/embed/taLvoVXFDmM\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'bently-ni-tank-kimi-istifade-etdiler', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/13\\/milyon-tl-lik-bentley-continental-gt-paletli-bir-tanka-donustu-video-1557741864.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2185', '96', '2019-05-13 13:31:53', '2019-05-13 13:31:53', 'Bakıda Bitcoin Pizza Day qeyd olunacaq', '\r\n<p><span><strong>Chip.az</strong> xəbər verir ki, bu il baş tutacaq görüş ötənilkindən fərqli olaraq konfrans şəklində deyil, daha çox \"networking\" formatında, yəni, müxtəlif sahələrin nümayəndələri öz aralarında iş əlaqələri qurmaq üçün nəzərdə tutulan formatda təşkil olunacaq. İştirakçılar qeyri-rəsmi şəraitdə sektoral mövzu ilə ünsiyyət qura biləcəklər.</span></p>\r\n<p><span>Qeyd edək ki, dünya \"Bitcoin\" icması bu günü hər il qeyd edir. 22 may 2010-cu il tarixi Las-Veqasdan olan proqramçı Laszlo Heinitz 2 pizzanı 10 min \"Bitcoin\" ödəməsi hadisəsi ilə yadda qalıb. Bu, kriptovalyutanın hazırkı məzənnəsi ilə təxminən 99 mln. manat təşkil edir.</span></p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'bakida-bitcoin-pizza-day-qeyd-olunacaq', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/13\\/bitcoin-pizza-day-concept.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2186', '96', '2019-05-14 06:39:26', '2019-05-14 06:39:26', 'eBay kriptovalyutaları qəbul edə bilər', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, bu xəbər mayın 12-dən başlayaraq kütləvi informasiya vasitələrində müzakirə edilir. Buna əsas səbəb Nyu-Yorkda keçirilən “<strong>Consensus 2019″</strong><span> </span>konfransında reklam bannerlərindəki<span> </span><a href=\"https://twitter.com/ImNotTheWolf/status/1127696721230934019\" target=\"_blank\" rel=\"noopener noreferrer\">məlumatlar</a><span> </span>olub. Bannerin bir tərəfində “Virtual Kriptovalyuta. Bu eBay-da baş verir” digər tərəfində isə “dünyanın ən böyük ticarət platformasında aktiv alıcıların sayı 179 milyona çatıb”. Bu məlumat kriptovalyuta cəmiyyətində aktiv müzakirələrə səbəb oldu və bəzi istifadəçilər eBay-ın bu təşəbbüsünü blockchain və rəqəmsal valyutaların kütləvi şəkildə qəbul olunmasına əhəmiyyətli dərəcədə kömək edəcəyini ifadə etdilər. <span>eBay özü bu informasiya ilə bağlı heç bir rəsmi aşıqlama verməyib. Buna baxmayaraq mayın 13-ü bitkoinin qiyməti 7033-dən 7846 dollara qalxdı. </span></p>\r\n<p><img data-attachment-id=\"5348\" data-permalink=\"https://kriptoinvest.az/2019/05/14/ebay-bitcoin-ile-odenisleri-qebul-ede-biler/ebay-2/\" data-orig-file=\"https://kriptoinvests.files.wordpress.com/2019/05/ebay.jpg\" data-orig-size=\"800,706\" data-comments-opened=\"1\" data-image-meta=\"{&quot;aperture&quot;:&quot;0&quot;,&quot;credit&quot;:&quot;&quot;,&quot;camera&quot;:&quot;&quot;,&quot;caption&quot;:&quot;&quot;,&quot;created_timestamp&quot;:&quot;0&quot;,&quot;copyright&quot;:&quot;&quot;,&quot;focal_length&quot;:&quot;0&quot;,&quot;iso&quot;:&quot;0&quot;,&quot;shutter_speed&quot;:&quot;0&quot;,&quot;title&quot;:&quot;&quot;,&quot;orientation&quot;:&quot;0&quot;}\" data-image-title=\"ebay\" data-image-description=\"\" data-medium-file=\"https://kriptoinvests.files.wordpress.com/2019/05/ebay.jpg?w=300\" data-large-file=\"https://kriptoinvests.files.wordpress.com/2019/05/ebay.jpg?w=723\" class=\"alignnone size-full wp-image-5348\" src=\"https://kriptoinvests.files.wordpress.com/2019/05/ebay.jpg?w=723\" alt=\"ebay\" srcset=\"https://kriptoinvests.files.wordpress.com/2019/05/ebay.jpg?w=723 723w, https://kriptoinvests.files.wordpress.com/2019/05/ebay.jpg?w=150 150w, https://kriptoinvests.files.wordpress.com/2019/05/ebay.jpg?w=300 300w, https://kriptoinvests.files.wordpress.com/2019/05/ebay.jpg?w=768 768w, https://kriptoinvests.files.wordpress.com/2019/05/ebay.jpg 800w\" sizes=\"(max-width: 723px) 100vw, 723px\" /></p>\r\n<p>Xatırladaq ki, bir müddət əvvəl eBay Amerika-nın vitse prezidenti<span> </span><strong>Scott Cutler</strong><span> </span>öz müsahibəsində bildirmişdi ki, şirkət bitcoin ilə ödənişlərin qəbulu imkanlarını araşdırır.</p>\r\n<p>Scott Cutler:</p>\r\n<p>“Biz bu ideyaya ciddi yanaşırıq, çünki rəqəmsal valyutalar ödəniş vasitəsi kimi daha optimal alətə çevrilməkdədir. Lakin indiki zamanda biz bunu reallaşdırmağa hələ hazır deyilik”.</p>\r\n<p> </p>', 'ebay-kriptovalyutalari-qebul-ede-biler', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/14\\/ebay.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2187', '96', '2019-05-14 07:35:03', '2019-05-14 07:35:03', 'Dünyada ən sürətli qatar təqdim olunub', '\r\n<p><span><strong>Chip.az</strong> xəbər verir ki, onun maksimal surəti 400 km/saat təşkil edir. Qatar sərnişinləri maksimal sürətindən bir qədər kiçik sürətlə (360 km/saat) daşıyacaq.</span></p>\r\n<p><span>Qatarın artıq sərnişinlərsiz sınaqları keçirilib. Qatar dəmir yolunun “JR East”ə aid olan ərazisində yoxlanılır. İstehsalçılar bildirirlər ki, layihənin son sınaq mərhələsi çərçivəsində qatar Aomori şəhərindən Senday şəhərinə qədər hərəkət edəcək.</span></p>\r\n<p><span>Şirkət nümayəndələrinin sözlərinə görə, qatar yeni standartlara uyğun olaraq hazırlanır. O, yalnız hərəkət sürətinə görə deyil, həmçinin rahatlığı və etibarlılığı ilə seçilir.</span></p>\r\n<p><span>Qatarın əsas xüsusiyyətlərindən biri onun tavanında quraşdırılmış xüsusi hava əyləclərini birləşdirən yeni əyləc sistemidir. Əyləc sisteminin əsas hissəsi bilavasitə relslərin yaxınlığında yerləşən maqnit lövhələridir (maqnit əyləc). Bununla yanaşı, qatarın ənənəvi əyləc konstruksiyası da mövcuddur.</span></p>\r\n<p><iframe width=\"560\" height=\"314\" src=\"//www.youtube.com/embed/Bs4wLpsZNfI\" allowfullscreen=\"allowfullscreen\"></iframe></p>', 'dunyada-en-suretli-qatar-teqdim-olunub', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/14\\/3f8773e67fc2a31205c1c040fcb0a3ae369f362b.jpeg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2188', '96', '2019-05-14 08:47:12', '2019-05-14 08:47:12', 'Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyinə yeni mətbuat katibi təyin olunub', '\r\n<p><span><strong>Chip.az</strong> xəbər verir ki, b</span><span>u təyinata qədər Günel Gözəlova “Azərpoçt” MMC-nin İctimaiyyətlə Əlaqələr şöbəsinin müdiri olub.</span></p>\r\n<p><span class=\"text_exposed_show\">Qeyd edək ki, Günel Gözəlova Bakı Dövlət Universitetinin jurnalistika fakultəsini bitirib. 2000-2003-cü illərdə Azərbaycan Dövlət Televiziyasında aparıcı-jurnalist, 2003-2016-cı illərdə Lider TV-də jurnalist, televiziya və radio aparıcısı, redaktor, “Gənclər” redaksiyasının rəhbəri, “Lider Xəbər” departamentinin rəis müavini vəzifələrində çalışıb. Günel Gözəlova eyni zamanda 6 il pedaqoji fəaliyyətlə də məşğul olub. </span></p>\r\n<p><span class=\"text_exposed_show\">“Bir inci xanım”, “Mübariz”, “Şahinlər”, “Hünərin gücü”, “İnibahn zirvəsi”, “İkinci həyat”, “Xilaskar” kimi bir sıra sənədli filmlərin ssenari müəllifi və redaktoru olub. </span></p>\r\n<p><span class=\"text_exposed_show\">Televiziya və radio sahəsində xidmətlərinə görə 2016-cı ildə “Azərbaycan Respublikası Prezidentinin fəxri diplomu” ilə təltif edilib.</span></p>\r\n<p style=\"text-align: right;\"><strong><span class=\"text_exposed_show\">Chip.az</span></strong></p>', 'neqliyyat-rabite-ve-yuksek-texnologiyalar-nazirliyine-yeni-metbuat-katibi-teyin-olunub', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/14\\/gozleova-800x445.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2189', '96', '2019-05-14 10:11:45', '2019-05-14 10:11:45', 'Texasda eyni nöqtəyə səkkiz saniyədə 11 dəfə ildırım düşüb', '<p><strong>ABŞ-ın Texas əyalətinin cənubundakı bir ərazidə eyni nöqtəyə səkkiz saniyədə 11 dəfə ildırım düşüb. </strong></p> <p><span><strong>Chip.az</strong> xəbər verir ki, bu anlar video lentə alınaraq “<a href=\"https://twitter.com/i/status/1126898443547488257\">Twitte</a>r”də paylaşılıb. Belə bir deyim var ki, ildırım eyni yerə iki dəfə düşməz. Amma buradan görünür ki, şimşək eyni yerdə çaxmağı sevir. ABŞ-da Hyuston yaxınlığında baş verən fırtınada bir əraziyə 11 dəfə ildırım düşməsi video lentə alınıb.(Aləmlərin müharibəsi kimi). </span></p> <p><span>Görüntülərin sahibi Brett Buffington “Hyustonda fırtınalı bir gecə. İldırım bir neçə saniyə ərzində eyni nöqtədə 11 dəfə çaxdı. Bu Fort Bend və Waller şəhərlərinin üzərindən keçən fırtınanın bir hissəsi idi”-deyə qeyd edərək paylaşıb.</span></p> <p><span><img src=\"https://www.webtekno.com/images/editor/default/0002/02/efb82eb2375775c6b5a305038af75ba81ccde4cc.jpeg\" /></span></p> <p><span> İstifadəçilərdən biri ildırım vuruşunun pis olduğunu, eyni zamanda 11 dəfə təkrarlanmasının ümumiyyətlə təsəvvür edə bilmədiyini yazıb. Videonu izləyən başqa bir nəfər isə çəkilişi edə bildiyi üçün Brett Buffingtonu təbrik edərək “Bunu necə alındıra bilirsiniz?Mənim bağçamda küçə pişiklərindən başqa maraqlı nəsə yoxdur”-deyə maraqlı şərh bildirib.</span></p> <p><span> Hadisə zamanı ölən və ya yaralıların olmadığı vurğulanıb.</span></p> <p><span></span></p> <p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'texasda-eyni-noqteye-sekkiz-saniyede-11-defe-ildirim-dusub', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/14\\/thh.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2190', '96', '2019-05-14 11:04:05', '2019-05-14 11:04:05', 'Azərbaycan fermerlərinə dronlar veriləcək', '\r\n<p><span><strong>Chip.az</strong> xəbər verir ki, bunu Kənd Təsərrüfatı Nazirliyinin Beynəlxalq əməkdaşlıq şöbəsinin sektor müdiri <strong>Toğrul Qafarbəyli </strong>bildirib.</span></p>\r\n<p><span>Onun sözlərinə görə, dronlardan 1-i pilot layihə çərçivəsində artıq ölkədədir: “Həmin nazirliyin Bitkiçilik İnstituna təhvil verilib. İnstitutun mütəxəssisi ondan istifadə ilə bağlı kurs keçəcək. Bundan sonra digər yerli mütəxəssislər də drondan istifadə edə biləcəklər. Fermerlər dronları icarə qaydasında əldə edəcəklər”.</span></p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'azerbaycan-fermerlerine-dronlar-verilecek', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/14\\/815cda7b77148ba.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2192', '96', '2019-05-15 05:45:48', '2019-05-15 05:45:48', 'Whatsapp-a gizli daxil ola bilən yeni proqram', '\r\n<p><span>Bu cihazlardan ən az biri demək olar ki, hər kəsin cibində var və şəxsi məlumatlarımızı bu cihazlarda saxlayırıq. Bundan başqa smartfonlar hackerlərin sevimli cihazlarından biridir. </span></p>\r\n<p><span><strong>Chip.az</strong> xəbər verir ki, İsrailin “NSO Group”u tərəfindən hazırlanan yeni casus proqram “WhatsApp” zəngləri ilə smartfonlara müdaxilə edə bilir. Hətta zəngə cavab verilmədikdə belə zərərli kodlar öz məqsədinə çatır. Telefona daxil olduqdan sonra isə öz zənglərini zəng jurnallarından silməyi bacarır. Yəni sözü gedən proqramın telefona müdaxilə etməsi və bu barədə heç kəsin xəbərinin olmaması ehtimalı var. “Android” və “iOS” bu proqramın hədəf auditoriyasına daxildir. Proqram haqqında çox geniş məlumat olmasa da artıq bir neçə həftədir ki, aktivləşdirilib. “WhatsApp” dan verilən açıqlamaya görə bunun arxasında hökumətlərə işləyən şirkət dayanır. Bu şirkətin proqramı smartfonların əməliyyat sistemini ələ keçirir. “WhatsApp” insan haqları təşkilatlarına bu barədə məlumat verdiyini bildirib. </span></p>\r\n<p><span><img src=\"https://www.webtekno.com/images/editor/default/0002/02/e57c057e9d2e435a3befbb2877796a212578e7f9.jpeg\" /></span></p>\r\n<p><span>“WhatsApp” bu hücumlardan nə qədər insanın zərər çəkdiyini öyrənmək üçün istintaqlara başlayıb. Şirkətin 1,5 milyard istifadəçisi var. “WhatsApp” ötən həftə ABŞ Ədliyyə Nazirliyinə məsələ ilə bağlı müraciət ünvanlayıb. Şirkətin mühəndisləri də bu istiqamətlərdə işlər aparırlar. Cümə günündən etibarən serverlərdəki boşluqlar bağlanıb. </span></p>\r\n<p><span><img src=\"https://www.webtekno.com/images/editor/default/0002/02/6abf3ed2e0e82a294e6cf4f711b0432fb1c5df98.jpeg\" /></span></p>\r\n<p><span>“NSG” Qrupu “Pegasus” kimi hökumətlərə casus proqram istehsal edərək satan bir qurumdur. Şirkət bununla terror və cinayətkarlığa qarşı mübarizə aparmaq üçün xidmət etdiyini bildirir. Ancaq bu fəaliyyətin nə qədər etibarlı olduğu mübahisəlidir. Proses tam araşdırıldıqdan sonra “WhatsApp” tərəfindən açıqlamaların veriləcəyi gözlənilir.</span></p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'whatsapp-a-gizli-daxil-ola-bilen-yeni-proqram', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/15\\/WHHH.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2193', '96', '2019-05-15 07:02:09', '2019-05-15 07:02:09', 'Ayın səthi tədricən kiçilir', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, bu proses milyon illərdi ki, davam edir və büzülmə səbəbiylə itirilən səth təxminən 50 metrdir.  Eyni zamanda Ayın sərt xarici səthinin çatlamasına səbəb olur. Beləliklə Ayda qırılma xəttləri yaranır və bunun nəticəsində planetin səthində zəlzələlər baş verir. Araşdırma ilə bağlı NASA-nın rəsmi <a href=\"https://www.nasa.gov/press-release/goddard/2019/moonquakes/\">saytında</a> tədqiqat üzrə bölmə yaradılıb və “YouTube”də bir video paylaşılıb. Saytda  yerləşdirilən məlumatda Ayda müşahidə olunan bu vəziyyət üzüm dənəsinə bənzədilir. Üzüm dənəsinin qurumağa başlaması ilə tədricən kiçilməsi hazırda Ayda baş verən proseslərlə eyniləşdirilir.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/cabfe2cf67c9155942366eca864df9e72defe1f1.jpeg\" /></p>\r\n<p>NASA “Apollon 11”, “Apollo 12”, “Apollo 14”, “Apollon 15” və “Apollon 16” vasitəsi ilə seysmometrləri Ayın səthinə buraxmışdı. Cəmi beş seysmometrlərdən birincisi  “Apollon 11” ilə göndərilsə də, bu seysmometr yalnız üç həftə işləmişdir. Beləliklə hazırda Ay səthində onlardan 4-ü fəaliyyət göstərir. Bu seysmometrlər 1969-cu ildən başlayaraq 1977-ci ilə qədər böyük və kiçik 28 zəlzələ qeydə almışdı.</p>\r\n<p>NASA  Ayın səthində görünən qırılma xətlərinin görüntülərini paylaşdı.<img src=\"https://www.webtekno.com/images/editor/default/0002/02/424b81a08523b147859a59fb54918876ac1ff260.jpeg\" /><strong>Aida İSAQ</strong></p>', 'ayin-sethi-tedricen-kicilir', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/15\\/640x360_79b622e7-654e-426c-810b-12bf191ce33d.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2194', '96', '2019-05-15 07:58:19', '2019-05-15 07:58:19', 'Saxta hesablar yaradanlarla bağlı ciddi tədbirlər görüləcək', '\r\n<p><span><strong>Chip.az </strong>xəbər verir ki, bu barədə DİM-dən məlumat verilib. </span></p>\r\n<p><span>Bildirilib ki, aparılan araşdırmalar zamanı bu hesablarda tələbə qəbulu kampaniyasının gedişi, dövlət qulluğuna qəbul, müxtəlif hazırlıq kurslarının reklamı, eləcə də Dövlət İmtahan Mərkəzinin fəaliyyətinə dair təhrif olunn məlumatlar yerləşdirildiyi məlum olub: \"Bəzi hesablar \"profil\" və \"cover\" fotoları üçün Mərkəzin loqotipindən (emblemindən) istifadə etməklə istifadəçiləri aldadır, öz fəaliyyətlərinə rəsmi xarakter verməyə çalışırlar. Bu tip səhifələr Dövlət İmtahan Mərkəzinin yaydığı məlumatlara istinad etmədən onların üzünü köçürməklə öz səhifələrində paylaşım edirlər. İstifadəçilərin onlara ünvanladığı suallara da təhrif olunan, yanlış cavablar verirlər.<br /></span></p>\r\n<p><span>Xatırladaq ki, Azərbaycan Respublikasının “Dövlət İmtahan Mərkəzi” söz birləşməsi və loqotipi (emblemi) Azərbaycan Respublikasının əmtəə nişanlarının Dövlət reyestrində qeydiyyata alınmış ona məxsus əmtəə nişanıdır.</span></p>\r\n<p><span>“Əmtəə nişanları və coğrafi göstəricilər haqqında” Azərbaycan Respublikası Qanununun 32-ci maddəsinə uyğun olaraq Dövlət İmtahan Mərkəzinin razılığı olmadan ona məxsus əmtəə nişanından istifadə edilməsi qeydə alınmış əmtəə nişanına dair hüquqların pozulması sayılır.</span></p>\r\n<p><span>Dövlət İmtahan Mərkəzi tərəfindən ona məxsus əmtəə nişanlarından qanunsuz istifadə etməyə yol vermiş şəxslər və qurumların Azərbaycan Respublikasının inzibati və cinayət qanunvericiliyinə uyğun olaraq məsuliyyətə cəlb olunması ilə bağlı müvafiq tədbirlər görüləcək.</span></p>\r\n<p><span>İstifadəçilərə daha diqqətli olmağı və Dövlət İmtahan Mərkəzinin adından yaradılmış saxta İnstagram hesablarına üzv olmamağı tövsiyə edirik. Xeyli vaxtdır ki, mərkəzin rəsmi İnstagram hesabı (<a href=\"https://www.instagram.com/stateexamcenter/?fbclid=IwAR3CF7hkYwyXcekz5VB_kjVHDEZ-4_Lr2A_KfZz8VXOhtJ2zOuTez3995v8\" target=\"_blank\" rel=\"noopener noreferrer\">https://www.instagram.com/stateexamcenter/</a>) fəaliyyət göstərir. Artıq minlərlə istifadəçi mərkəzin fəaliyyətinə, qəbul kampaniyasına dair ən yeni və zəruri məlumatları bu hesabdan əldə edir. Əgər Siz də mərkəzin təqdim etdiyi məlumatları operativ şəkildə əldə etmək və sizi maraqlandıran suallara cavab tapmaq istəyirsinizsə, göstərilən hesaba üzv olun. İnstagramda yaradılan saxta hesabların təqdim etdiyi məlumatlara görə Dövlət İmtahan Mərkəzi heç bir məsuliyyət daşımır\".</span></p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'saxta-hesablar-yaradanlarla-bagli-ciddi-tedbirler-gorulecek', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/15\\/image.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2195', '96', '2019-05-15 08:12:52', '2019-05-15 08:12:52', 'Azərbaycanda ilk dəfə taxılyığan kombayn və elektrobus istehsal olunub', '\r\n<p><span><strong>Chip.az</strong> xəbər verir ki, İB-nin yaydığı məlumata görə, Azərbaycanda ilk dəfə olaraq konveyerdən “PALESSE KZS-575” markalı taxılyığan kombayn və E-321 markalı elektrobus çıxıb.</span></p>\r\n<p><span>Tədbirdə Belarusun baş nazirinin müavini İqor Vasiliyeviç Lyaşenko, Belarusun Sənaye Nazirinin müavini Dmitri Aleksandroviç Kovçik, “Qomselmaş” ASC-nın baş direktoru Aleksandr Aleksandroviç Novikov, Belarusun ölkəmizdəki səfiri Gennadi Axramoviç, Gəncə şəhər icra hakimiyyətinin başçısı Niyazi Bayramov, Gəncə avtomobil zavodu İstehsalat Birliyi Müşahidə Şurasının sədri, millət vəkili Xanlar Fətiyev, Gəncə avtomobil zavodu İB-nin direktoru Kamran Nəzərov və digər qonaqlar iştirak ediblər. Qonaqlar taxılyığan kombaynın yığım xətti və zavodla tanış olublar.</span></p>\r\n<p><span>Sonra tədbiri giriş sözü ilə Gəncə avtomobil zavodu İstehsalat Birliyi Müşahidə Şurasının sədri, millət vəkili X.Fətiyev açaraq qonaqları salamlayıb və bildirib ki, bu gün müəssisənin həyatında çox əlamətdar bir gündür:</span></p>\r\n<p><span>“Biz ilk dəfə traktorları yığmağa başlayanda çoxları buna inanmir və rişxəndlə yanaşırdılar. Amma bu gün Gəncə avtomobil zavodunda yığım xəttindən ilk taxılyığan kombayn çıxacaq və biz bunun şahidi olacağıq. Ölkə başçısı İlham Əliyevin tapşırığına əsasən kənd təsərrüfatı texnikalarının yığımına başladıq və bu gün artıq kombayn yığırıq. Bu gün Azərbaycanda ilk dəfə olaraq elektrobusların yığımını reallaşdırdıq və müasir, ekoloji təmiz, alternativ enerji ilə təmin olunmuş, komfortlu bir elektrobusu istifadəyə veririk. Bu elektrobuslar artıq Minskin küçələrində əhaliyə yüksək səviyyədə xidmət edir. Gələcəkdə elektrobusların 30-40% ehtiyat hissələrinin Gəncədə istehsal olunması nəzərdə tutulur. Ümidvarıq ki, bizim elektrobusların Azərbaycanın küçələrində ekoloji baxımdan təmiz, keyfiyyətli xidmət göstərəcək” deyə X.Fətiyev əlavə edib.</span></p>\r\n<p><span>Sonra çıxış edən Gəncə icra hakimiyyətinin başçısı N.Bayramov qonaqları salamladıqdan sonra Gəncə avtomobil zavodunda gördüklərinin onu sözün yaxşı mənasında təəcübləndirdiyini bildirdi:</span></p>\r\n<p><span>“Azərbaycan-Belarus respublikaları arasında çox yaxın dostluq münasibətləri var. İkitərəfli əməkdaşlığın bariz nümunələrindən bir də Gəncə avtomobil zavodudur. Biz zavodda yığılan texnikalarla taniş olduq. Həm traktorların, həm yenicə xəttdən çıxacaq kombaynların və o cümlədən müasir elektrobusların keyfiyyəti çox yüksəkdir. Biz inanırıq ki, elektrobusların yığımı gələcəkdə də davam etdiriləcəkdir. Bu işlərdə kollektivə uğurlar arzu edirəm”</span></p>\r\n<p><span>Belarusun baş nazirinin müavini İ.V.Lyaşenko Gəncə avtomobil zavodu İB-ni Belarusun maşınqayırma sənayesi ailəsinin bir üzvünı çevrildiyini və uzun müddətdir ikitərəfli sıx əməkdaşlığın olduğunu vurğuladı:</span></p>\r\n<p><span>“Biz icra başçısı Niyazi Bayramovla texnikalarla tanış olduq. Burada yığılan həm taxılyığan kombaynların, həm də elektrobusların keyfiyyəti çox yüksəkdir. Mən Bakıda təşkil olunacaq kənd təsərrüfatı sərgisində bu txnikaların yüksək keyfiyyəti barədə Azərbaycan Prezidenti İlham Əliyevə məlumat verəcəyəm. “Qomselmaş” ASC-nın baş direktoru Aleksandr Aleksandroviç Novikov da Gəncədə yığılan kombaynları çox yüksək dəyərləndirdi. Ümidvaram ki, ikitərəfli əməkdaşlıq bundan sonra da davam edəcək və genişlənəcək” deyə Belarusun baş nazirinin müavini vurğuladı.</span></p>\r\n<p><span>Çıxışlardan sonra “PALESSE KZS-575” markalı ilk taxılyığan kombayn alqışlar altında konveyerdən çıxıb. Bundan sonra qonaqlar birlikdə yeni yığılan E-321 markalı elektrobusu sınaqdan keçiriblər. Onlara bildirilib ki, yeni elektrobuslar həm ekoloji baxımdan, həm də yanacağa qənaət baxımından çox sərfəlidir. 83 sərnişinin daşınmasını reallaşdıra biləcək avtobuslar 26 oturacaqla, kondensionerlə, həmçinin məlumat monitoru və video nəzarət sistemi ilə təmin olunub. 60 kilometr/saat sürətlə hərəkət edə biləcək elektrobusun akkumulyatoru şəhər rejimində RGZP/G/300KW 600V-EN doldurma stansiyası tərəfindən 6 dəqiqə ərzində tam doldurulur və enerji bərpa olunur.</span></p>\r\n<p><span>Qonaqların diqqətinə o da çatdırılıb ki, “PALESSE KZS-575” markalı taxılyığan kombaynın mühərriki 114 / 155 at gücündədir. Texnikanın taxılbiçəni 4-5 metr arasındadır. Taxıl döyümü sistemində üyüdən aparatı tipi barabanlı, barabanın firlanma tezliyi isə 510-875 dövr/dəqiqədir. Kombaynların hərəkət sürəti 20 kilometr saatdır.</span></p>\r\n<p><span>Tədbirdə o da vurğulanıb ki, əgər sifariş olarsa Gəncə avtomobil zavodu İB-i il ərzində 150 elektrobus, 120 kombayn yığmaq gücünə malikdir.</span></p>\r\n<p><span>Məlumat üçün bildirilib ki, bu günədək müəssisədə ümumilikdə 10 549 ədəd 11 modeldə traktor, 143 xüsusi təyinatlı traktor yığılaraq təhvil verilib. Bu texnikalardan 9825 -i dövlət sifarişi əsasında \"Aqrolizinq\" ASC-nə, qalan 724 -ü isə fermerlərə və iş adamlarına satılıb. 2019-cu ilin 4 ayı ərzində Gəncə avtomobil zavodu İB-də ümumilikdə 478 texnika istehsal olunub. Bunlardan 466-i müxtəlif model traktorlar, 1 MAZ markalı qoşqulu avtomobil, bir ədəd Kamaz markalı avtomobil, 2 MAZ markalı avtobus, 5 özüboşaldan traktor qoşqusu yığılib. 2019-cı ilin aprel ayının 31-nə qədər Gəncə avtomobil zavodu İstehsalat Birliyində 8 modeldə, müxtəlif modifikasiyalarda 2864 ədəd MAZ avtomobilləri istehsal edilərək təyinatı üzrə təhvil verilib. Bu avtomobillərin yığımının 30-40 % -ni yerli istehsal təşkil edir. Aprelin 31-nə qədər müəssisədə 330 MAZ qoşqusu və 3202 asma avadanlıq istehsal edilib. Bu müddətədək Gəncə avtomobil zavodu İB-də ümumilikdə 208 ədəd KAMAZ markalı yük avtomobili və 411 URAL avtomobili istehsal edilib.</span></p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'azerbaycanda-ilk-defe-taxilyigan-kombayn-ve-elektrobus-istehsal-olunub', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/15\\/gence_avtomobil_zavodu_140519__(7).jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2196', '96', '2019-05-15 08:58:07', '2019-05-15 08:58:07', 'Mazda 3-ün yeni görüntüləri yayımlandı', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, ötən il Los Angeles avtomobil  sərgisində yeni vasitəsi “Mazda3”ü təqdim edən şirkət sözü gedən vasitəninin tanıtımını həyata keçirmək məqsədi ilə professional fotoqrafa müraciət edir.</p>\r\n<p>“Mazda” yüksək dizayn üslubunda hazırladığı bu yeni modeli nümayiş etdirmək üçün məşhur fotoqraf John Rakin Waddell ilə razılıq əldə edir. Beləliklə Rankinin üzərində saatlarını sərf etdiyi “Mazda3”ün (qırmızı qapılar və boz rəngli sedan ilə modelləşdirilmiş) şəkilləri hər kəsi heyran etdi.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/3ea3a05d282e3c8edb4a579dbd936909569b8af0.jpeg\" /></p>\r\n<p>\"Release, Liberation, Zeal, Serenity, Panach and Verve\" adlandırılaraq yayımlanan 6 fərqli fotoşəkilin hər hansı bir “Photoshop” proqramında hazırlanmasından söhbət belə gedə bilməz. Rakin üzərində işlənmiş kimi görünən böyük görüntüləri əldə etmək üçün kameranı fiziki olaraq hərəkət etdirmək üsulundan istifadə etmişdir.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/3414529afb2fb8396c18455ddce1ca3bf25043aa.jpeg\" /></p>\r\n<p>Qeyd edək ki, John Rakin Kraliça II Elizabet, Daniel Craigin, Kate Moss, David Bowie və Monica Bellucci kimi məşhur simaların fotoqrafı olub. Bundan başqa  Miley Cyrus, Rita Ora və Kelis kimi sənətçilərin musiqi kliplərini ekranlaşdırıb. Bu baxımdan  “Mazda”nın Avropalı dizayn direktoru Jo Stenuit  “Rankinin avtomobil sahəsini sənətlə kompazisiya etmək baxımdan özünə məxsus üsulları var” deyə bildirib.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/f35c3eab5487dd5bf4bbabb0dd0f521e511f5e14.jpeg\" /></p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'mazda-3-un-yeni-goruntuleri-yayimlandi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/15\\/8e5d9b6749e14896a46b3b4af73d03066a6ad942.jpeg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2197', '96', '2019-05-15 10:22:10', '2019-05-15 10:22:10', 'OnePlus yeni Bullets Wireless 2 qulaqlıqlarını təqdim edib ', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, şirkət eyni zamanda  yeni nəsil simsiz qulaqlıqları olan “Bullets Wireless 2”ni də nümayiş etdirib.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/5240d0bdf2aea602f4eb0e4ebfb555c65df921dc.jpeg\" /></p>\r\n<p>“Bullets Wireless 2” birinci nəsil “Bullets Wireless”dən daha çox oval və minimal dizayna malikdir. Beləliklə qulaqlıöın yalnız səs keyfiyyəti deyil həm də istifadə rahatlığı artmış olur. “OnePlus”un açıqlamalarına görə, “Bullets Wireless 2” “Warp Charge” sürətli batareya texnologiyasını dəstəkləyir. Yəni 10 dəqiqə müddətində enerji yığması ilə 10 saat musiqi dinləməyə imkan verir.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/b5efb1fdd51236a169343609ff4d7375f9e26c85.jpeg\" /></p>\r\n<p>Bundan başqa yeni qulaqlıqlarda “Bluetooth 5” və “AptX HD” dəstəklənir. Bu yolla uyğun cihazlarla yüksək keyfiyyətli əlaqəni təmin etmək asanlaşır. “OnePlus” smartfonları ilə çox sürətli əlaqə qura bilən qulaqlıqlar Apple ilə rəqabət apara bilməyən Android cihazlarına rəqib olaraq gəlir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'oneplus-yeni-bullets-wireless-2-qulaqliqlarini-teqdim-edib', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/15\\/Oneplus-bullets-Wireless-2-tan\\u0131t\\u0131ld\\u0131.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2198', '96', '2019-05-15 11:05:59', '2019-05-15 11:05:59', 'Uber Black səssiz sürücü seçimini təklif edir', '\r\n<p>Sürücülərin çox hissəsi demək olar ki, “Maşına kimsə minsəydi söhbət edərdik” deyə gözləyərək bunu işinin vacib cəhətlərindən biri olduğunu hesab edir. Bəzi insanlar bunu xoşlasa da digər qrupun nümayəndələri  bunu xoşlamırlar.</p>\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Uber”in “Uber Black” və “Uber Black SUV” istifadəçiləri nəqliyyat vasitələrini çağırmadan əvvəl sürücülərinin danışmağa nə qədər meyilli olub-olmadığını seçə biləcəklər. Belə ki, üç seçim şansı olacaq:</p>\r\n<p><em><strong>\"Mən səssiz qalmağa üstünlük verirəm\"</strong></em></p>\r\n<p><em><strong>\"Mən söhbət etməyi sevirəm”</strong></em></p>\r\n<p><em><strong>“Fərqi yoxdur”</strong></em></p>\r\n<p>Şəxsin seçimi Uber sürücülərinə də çatdırılacaq.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/6b40f3b8d8c2a10a5093e58ffe84b552dfaf81d5.jpeg\" /></p>\r\n<p>“Uber”in yeni xüsusiyyətinin tətbiqi şirkətin daha bahalı xidmətlərinə olan tələbatı artıracağı gözlənilir. Yolda yatmaq, telefondan istifadə etmək və ya avtomobildə dincəlmək istəyənlərin daha bahalı xidmət servisinə yönələcəkləri düşünülür. Digər tərəfdən bu xüsusiyyət sürücüləri susmağa məcbur etmir, yalnız sərnişinin hansı xarakterdə olduğunu və hansı seçimə  üstünlük verdiyini bilməyə kömək edir.</p>\r\n<p>“Uber”in yeni xüsusiyyəti istifadəçiləri avtomobilə zəng etmədən əvvəl seçimlərini tərtib etməyə imkan verir. Vasitə çağırıldıqdan sonra bu seçimlər dəyişdirilə bilməz.  Avtomobilin içərisinin isti və ya soyuq olmasını da seçmək mümkündür.</p>\r\n<p>“Uber Black” sürücüləri sifariş olunduqdan sonra ləğv etmədən öncə  15 dəqiqə gözləyirlər. Digər tərəfdən 5 dəqiqədən sonra sürücülər kompensasiya ediləcək və gecikmə hallarında tariflər kəsilməyə davam ediləcək. Sürücülər texniki olaraq istənilən vaxt gözləməni ləğv edə biləcəklər.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/e3aec55c25d1c6ce517becd0fcc012ccb27c665a.jpeg\" /></p>\r\n<p>“Uber Black” sərnişinlərinə mükafat telefon dəstəyi veriləcək. “Uber”  “Uber Black” üçün qeydiyyatdan keçən sürücülərin daha yeni və gözəl avtomobilləri olduğuna diqqət yetirəcək. Qaydaları isə ölkələrdəki mərkəzlər deyil əsas qərargah təyin edəcək.</p>\r\n<p>“Uber”dən  açıqlama verilməməsinə baxmayaraq bu xüsusiyyətlərin bütün beynəlxalq \"Uber\" xidmətlərinə paylanması gözlənilir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>\r\n<p> </p>', 'uber-black-sessiz-surucu-secimini-teklif-edir', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/15\\/uber-black-sessiz-surucu-ozelligine-kavusuyor-12049263_o.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:18 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2199', '96', '2019-05-15 12:28:27', '2019-05-15 12:28:27', 'Azərbaycanda vahid dövlət-biznes elektron reyestri yaradılır - FƏRMAN', '\r\n<p><span><strong>Chip.az</strong> xəbər verir ki, fərmanla Azərbaycan Respublikası Prezidentinin 2018-ci il 26 iyun tarixli 148 nömrəli fərmanı ilə təsdiq edilmiş “Kiçik və orta biznes evlərində mikro, kiçik və orta sahibkarlıq subyektlərinə göstərilən xidmətlərin siyahısı”na uyğun olaraq mikro, kiçik və orta sahibkarlıq subyektlərinə göstərilən xidmətlərin və verilən hüquqmüəyyənedici sənədlərin vahid “G2B” (dövlət-biznes) elektron reyestri (bundan sonra – “G2B” reyestri) Dövlət Xidmətlərinin Elektron Reyestrinin (bundan sonra – Elektron Reyestr) tərkibində təşkil edilir.</span></p>\r\n<p><span>Azərbaycan Respublikasının Prezidenti yanında Vətəndaşlara Xidmət və Sosial İnnovasiyalar üzrə Dövlət Agentliyinə Azərbaycan Respublikasının Kiçik və Orta Biznesin İnkişafı Agentliyi ilə birlikdə “G2B” reyestrinin təşkili və fəaliyyətinin təmin edilməsi ilə bağlı tədbirlər görmək, həmçinin “Dövlət Xidmətlərinin Elektron Reyestrinin yaradılması ilə bağlı tədbirlər haqqında” Azərbaycan Respublikası Prezidentinin 2014-cü il 11 sentyabr tarixli 262 nömrəli fərmanına uyğun olaraq “ASAN xidmət indeksi”ni təşkil edən parametrləri rəhbər tutmaqla, “G2B” reyestrinə daxil edilmiş xidmətlərin qiymətləndirilməsini Elektron Reyestr vasitəsilə həyata keçirmək tapşırılıb.</span></p>\r\n<p><span>3. Azərbaycan Respublikasının İqtisadiyyat Nazirliyi:</span></p>\r\n<p><span>3.1. bu Fərmanın 2.2-ci bəndinə əsasən həyata keçirilən qiymətləndirmənin nəticələrini nəzərə alaraq, Azərbaycan Respublikası Kiçik və Orta Biznesin İnkişafı Agentliyinin Elektron Reyestr vasitəsilə “G2B” reyestrinə daxil etdiyi hər bir xidmətin “KOB indeksi”ni təşkil edən aşağıdakı parametrləri rəhbər tutmaqla qiymətləndirilməsini təmin etsin:</span></p>\r\n<p><span>3.1.1. xidmətin mikro, kiçik və orta biznesin (KOB-un) inkişafına təsiri;</span></p>\r\n<p><span>3.1.2. KOB-lara göstərilən xidmətin sadələşdirilməsinin və ya ləğvinin insan həyatına və sağlamlığına, ətraf mühitə, dövlətin iqtisadi maraqlarına təsiri;</span></p>\r\n<p><span>3.2. bu Fərmanın 3.1-ci bəndinə uyğun olaraq həyata keçirilən qiymətləndirmənin nəticələri barədə ildə bir dəfə Azərbaycan Respublikasının Prezidentinə məlumat versin.</span></p>\r\n<p><span>4. Mərkəzi və yerli icra hakimiyyəti orqanlarına, dövlət adından yaradılan publik hüquqi şəxslərə və səhmlərinin (paylarının) nəzarət zərfi dövlətə məxsus olan hüquqi şəxslərə tapşırılsın, bələdiyyələrə isə tövsiyə edilsin ki:</span></p>\r\n<p><span>4.1. “G2B” reyestrinin fəaliyyətinin təmin edilməsi ilə bağlı Azərbaycan Respublikası Prezidentinin “Dövlət Xidmətlərinin Elektron Reyestrinin yaradılması ilə bağlı tədbirlər haqqında” 2014-cü il 11 sentyabr tarixli 262 nömrəli Fərmanının 3-cü hissəsindən və “Azərbaycan Respublikası Kiçik və Orta Biznesin İnkişafı Agentliyinin fəaliyyətinin təmin edilməsi haqqında” 2018-ci il 26 iyun tarixli 148 nömrəli Fərmanının 9.1-ci bəndindən irəli gələn tədbirlərin həyata keçirilməsini təmin etsinlər;</span></p>\r\n<p><span>4.2. “G2B” reyestrinin təşkili və fəaliyyətinin təmin edilməsi ilə bağlı Azərbaycan Respublikası Kiçik və Orta Biznesin İnkişafı Agentliyinin müraciəti əsasında Agentliyə kömək göstərilməsini, onun sorğularının operativ qaydada və hərtərəfli cavablandırılmasını təmin etsinlər.</span></p>\r\n<p><span>5. Azərbaycan Respublikasının Nazirlər Kabineti:</span></p>\r\n<p><span>5.1. Azərbaycan Respublikası Prezidentinin aktlarının bu Fərmana uyğunlaşdırılması ilə bağlı təkliflərini üç ay müddətində hazırlayıb Azərbaycan Respublikasının Prezidentinə təqdim etsin;</span></p>\r\n<p><span>5.2. Azərbaycan Respublikası Nazirlər Kabinetinin normativ hüquqi aktlarının bu Fərmana uyğunlaşdırılmasını üç ay müddətində təmin edib Azərbaycan Respublikasının Prezidentinə məlumat versin;</span></p>\r\n<p><span>5.3. mərkəzi icra hakimiyyəti orqanlarının normativ hüquqi aktlarının bu Fərmana uyğunlaşdırılmasını nəzarətdə saxlasın və icrası barədə beş ay müddətində Azərbaycan Respublikasının Prezidentinə məlumat versin;</span></p>\r\n<p><span>5.4. Azərbaycan Respublikası Kiçik və Orta Biznesin İnkişafı Agentliyinin təklifləri əsasında mikro, kiçik və orta sahibkarlıq subyektlərinə göstərilən dövlət xidmətlərinin “KOB indeksi” üzrə qiymətləndirilməsi qaydasını beş ay müddətində təsdiq etsin;</span></p>\r\n<p><span>5.5. bu Fərmandan irəli gələn digər məsələləri həll etsin.</span></p>\r\n<p><span>6. Azərbaycan Respublikası Prezidentinin 2018-ci il 26 iyun tarixli 148 nömrəli Fərmanı (Azərbaycan Respublikasının Qanunvericilik Toplusu, 2018, № 6, maddə 1238, № 10, maddə 1991, № 11, maddə 2287; Azərbaycan Respublikası Prezidentinin 2019-cu il 1 mart tarixli 570 nömrəli və 10 aprel tarixli 619 nömrəli fərmanları) ilə təsdiq edilmiş “Kiçik və orta biznes evlərində mikro, kiçik və orta sahibkarlıq subyektlərinə göstərilən xidmətlərin siyahısı”nda aşağıdakı dəyişikliklər edilsin:</span></p>\r\n<p><span>6.1. “Dövlət orqanının adı” sütununda “orqanının” sözündən sonra “(qurumunun)” sözü əlavə edilsin;</span></p>\r\n<p><span>6.2. 13-cü hissənin “Göstərdiyi xidmətlər” sütununun 5-ci bəndinə “avtomobil” sözündən əvvəl “Bakı, Sumqayıt və Gəncə şəhərlərinin inzibati ərazisi istisna olmaqla, Azərbaycan Respublikasının digər inzibati ərazilərində” sözləri əlavə edilsin;</span></p>\r\n<p><span>6.3. 19-cu hissənin “Göstərdiyi xidmətlər” sütununun 3-cü bəndi aşağıdakı redaksiyada verilsin:</span></p>\r\n<p><span>“3. Bakı şəhərinin inzibati ərazisində ümumi istifadədə olan nəqliyyat vasitələri ilə müntəzəm sərnişindaşıma haqqında müqavilənin bağlanılması”.</span></p>\r\n<p><span>7. Azərbaycan Respublikasının Ədliyyə Nazirliyi mərkəzi icra hakimiyyəti orqanlarının normativ hüquqi aktlarının və normativ xarakterli aktların bu Fərmana uyğunlaşdırılmasını təmin edib Azərbaycan Respublikasının Nazirlər Kabinetinə məlumat versin.</span></p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'azerbaycanda-vahid-dovlet-biznes-elektron-reyestri-yaradilir-ferman', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/15\\/2015-10-13-16-49-57ilham-imza.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2200', '96', '2019-05-15 12:51:58', '2019-05-15 12:51:58', 'WhatsApp qaranlıq rejimi yenidən aktivləşdirdi', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, dünyanın ən populyar mesajlaşma proqramı olan “WhatsApp”ın qaranlıq rejimin aktiv olunması üzərində işlər apardığı heç kimə sirr deyil. Şirkət bir müddət öncə tənzimləmələr menyusuna qaranlıq rejim funksiyasını əlavə etsə də 2.19.123 versiyasında sözü gedən rejimə aid bütün  kodları aradan qaldırmışdı.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/4ea83733c78f32089987f51f00b1e7436e069b87.jpeg\" /></p>\r\n<p>“WhatsApp” Android beta tətbiqinin 2.19.139 versiyasına qaranlıq rejimin kodlarını yenidən əlavə etdi. Bu dəfə qaranlıq rejimə zənglər, “hekayə” bölməsi və söhbətlər də daxildir. Ancaq xüsusiyyət üzərində hələ də təkmilləşdirilmə işləri aparılır.</p>\r\n<p>Paylaşılan görüntülərə görə WhatsApp ekranı tünd qara rəngə boyamaq əvəzinə tünd boz arxa fonun  tətbiq olunması üzərində işləyir. Bu rəng palitrası OLED ekran istifadəçiləri üçün yaxşı seçim hesab olunmur. İnsanların adları kimi mətn hissələri də hələ yaşıl rəngdə görünür. Ancaq son versiyada ağ rəngdə olması gözlənilir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'whatsapp-qaranliq-rejimi-yeniden-aktivlesdirdi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/15\\/wppp.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2201', '96', '2019-05-15 13:28:58', '2019-05-15 13:28:58', 'Instagram-dakı izləyicilərinin səsverməsi ilə gənc qız intihar etdi', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, Malaziyada baş verən hadisə sosial şəbəkələrin həyatımızda nə qədər rol oynadığını açıq şəkildə sübut edib. Ölkənin şərqindəki Salavak əyalətində adı açıqlanmayan 16 yaşlı bir qız “Instagram” hesabında paylaşdığı anket sualın nəticəsini gördükdən sonra intihar edib.</p>\r\n<p>Gənc qız izləyicilərinə “Həqiqətən mənim üçün önəmlidir Ölüm yoxsa Həyat” deyə sual ünvanlayıb.  Sorğuya qatılan istifadəçilərin əksəriyyəti ölümü seçib. Beləlikə sözü gedən gənc qızın bu nəticəyə görə ölümə qərar verdiyi iddia edilir. Polisin apardığı araşdırmalara görə respondentlərin 69% -i ölümü seçmişdir.</p>\r\n<p><img src=\"https://i.ytimg.com/vi/dsqHKFk5xn8/maxresdefault.jpg\" alt=\"Instagram ask question yes no ile ilgili görsel sonucu\" /></p>\r\n<p>Baş verən hadisə ölkədə böyük bir müzakirələrə səbəb olub. Millət vəkili Ramkarpal Singh ölümə təsdiq cavabını verən hər kəsin cəzalandırılmasını tələb edib.</p>\r\n<p>Singh əgər insanların hamısı “həyat” variantını seçərdilərsə gənc qızın yaşayacağına inandığını bildirərək “ İstifadəçilərin çoxsu həyatına son qoymasınma onu sövq etməsəydilər o bu gün yaşaya bilərdimi? Əgər ona peşəkar yardım alması təklif edilərdisə yenədə intiharı edəcəkdimi? Həqiqətən dəistifadəçilərin fikirləri buna səbəb olubmu?” –deyə suallar ünvanlayıb.</p>\r\n<p>Singh intihara təşəbbüsün ölkədə cinayət olduğunu vəbuna görə də insanları intihara təşviq etməyin də üçün cinayət olmalı olduğunu qeyd edib.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/30f676d2f0ab38112a556a65ab5be72e849b3e6e.jpeg\" /></p>\r\n<p>Malaziyanın Gənclər və İdman naziri Syed Saddiq Abdul Rahman bu faciənin ölkənin ruh sağlamlığını sual altında qoyduğunu vurğulayıb. Rəhman eyni zamanda gənclərin psixoloji vəziyyətlərindən narahat olduğunu və bu mövzunun ölkə səviyyəsində müzakirə etməyin vacibliyini əlavə edib.</p>\r\n<p>Qeyd edək ki, “Instagram” fevral ayında verdiyi açıqlamaya görə özünə zərər yetirmək məqsədli məzmunların sosial platformada paylaşılmasına əngəl olacağını bildirmişdi. Bu 2014-cü ildə 14 yaşlı Molly Russellin intiharından sonra tətbiq olunacaq yeni xüsusiyyət idi.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>\r\n<p></p>', 'instagram-daki-izleyicilerinin-sesvermesi-ile-genc-qiz-intihar-etdi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/15\\/63448d73c139112015793772ae79d16985e1b038.jpeg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2202', '96', '2019-05-16 05:21:05', '2019-05-16 05:21:05', 'Made in Azerbaijan: İnnovasiyalar və Texnologiyalar Forumu olacaq', '\r\n<p><strong>Chip.az</strong><span> </span>xəbər verir ki, tədbir Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyinin yanında İnformasiya Texnologiyalarının İnkişafı Dövlət Fondunun dəstəyi və təşəbbüsü ilə baş tutacaq.<span> </span>Forumun keçirilməsində əsas məqsəd innovativ və texnoloji məhsul və xidmətlərin daha geniş tanıdılması və onların ixracına dəstək olmaqdır.</p>\r\n<p>Tədbirdə yerli innovativ məhsul və texnologiyaların ixrac perspektivləri, innovativ biznes ekosisteminin inkişafı, yaradılan məhsul və xidmətlərdən ölkə daxilində həm özəl, həm də dövlət sektoru tərəfindən istifadənin təşviq edilməsi üzrə təqdimat və müzakirələr yer alacaq.</p>\r\n<p>Forumda dövlət qurumları, özəl sektor, beynəlxalq təşkilatlar, ölkəmizdə fəaliyyət göstərən xarici diplomatik korpusun nümayəndələri, habelə innovasiya ekosisteminin iştirakçıları, startapçılar və xarici ölkələrdən olan nümayəndələrin iştirakı nəzərdə tutulur.</p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'made-in-azerbaijan-innovasiyalar-ve-texnologiyalar-forumu-olacaq', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/16\\/1c997-1557829541.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2203', '96', '2019-05-16 06:14:38', '2019-05-16 06:14:38', 'Google uşaqlara düzgün tələffüzü öyrədəcək - Yeni proqram', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Google” az yaşlı uşaqlara oxumağı öyrənməyə kömək etmək üçün nəzərdə tutulan pulsuz  mobil tətbiqi beta etiket ilə istifadəyə verib. Belə ki, “Rivet” adlı proqram uşaqları dinləyərək oxuduqları kitabdakı sözlərin düzgün tələffüzünü öyrədir. Sözü gedən tətbiqetmə uşaqlar üçün mövzu və oxunuş səviyyəsinə görə təsnif edilmiş 2000-dən çox kitab ilə zəngindir.</p>\r\n<p>Uşaqları dinləyərkən səhv bir tələffüz eşidəndə proqram vizual məsləhətlər vasitəsi ilə köməklik göstərir. Beləliklə söz yanlış tələffüz edildikdə yeni bir ekran açılır və sözün düzgün tələffüzü eşidilir. Sonra tətbiq istifadəçinin yenidən cəhd etməsini istəyir. Orfoepik qaydalara doğru şəkildə əməl edildikdən sonra səhifənin qalan hissəsini oxumaq mümkün olur.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/b3025d8c5472e15cc446218d8598b389ac855d90.jpeg\" /></p>\r\n<p>Proqramın bu xüsusiyyəti yalnız Android versiyalarında və bəzi kitablarda mövcuddur. Yaxın zamanlarda iOS əməliyyat sistemlərində dəstəklənməsi və yeni kitabların əlavə olunması gözlənilir.</p>\r\n<p>Adı çəkilən proqram gözəl dizaynı və əyləncəli olması ilə uşaqlara oxu vərdişlərini inkişaf etdirməyə kömək edəcək. Zamanla yeni kitabların əlavə olunması və proqramın təkmilləşdirilməsi onun faydalılığını daha daha da artırması gözlənilir.</p>\r\n<p><a href=\"https://play.google.com/store/apps/details?id=com.area120.studybuddy.sagaflutter&amp;hl=tr\">https://play.google.com/store/apps/details?id=com.area120.studybuddy.sagaflutter&amp;hl=tr</a> </p>\r\n<p><a href=\"https://itunes.apple.com/us/app/rivet-by-area-120/id1405632917?mt=8\">https://itunes.apple.com/us/app/rivet-by-area-120/id1405632917?mt=8</a> </p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ </strong></p>', 'google-usaqlara-duzgun-teleffuzu-oyredecek-yeni-proqram', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/16\\/rii.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2204', '96', '2019-05-16 07:00:04', '2019-05-16 07:00:04', 'Sürücülərə taxoqraf sistemi ilə nəzarət olunacaq', '\r\n<p><strong>Chip.az </strong>xəbər verir<strong></strong><em><strong> </strong></em> ki, tədbirdə Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyindən Milli.Az-a verilən məlumata görə, nazirlik yanında Dövlət Avtomobil Nəqliyyatı Xidmətinin nümayəndələri iştirak edib.</p>\r\n<p>Avropa Əsas Sertifikatlaşdırma Orqanının İspra şəhərində keçirilmiş növbəti sessiyasında bu təşkilatın mövcud prosedur qaydalarına uyğun olaraq Azərbaycan Respublikasının rəqəmsal taxoqraf sisteminin tətbiqi ilə bağlı Milli Açarları sertifikatlaşdırılıb.</p>\r\n<p>Görüş zamanı beynəlxalq avtomobil daşımalarını həyata keçirən nəqliyyat vasitələri heyətinin iş və istirahət rejiminə nəzarətinin təşkili sahəsində ikinci nəsil \"smart taxoqraf\"ların (Generation-2 Smart Tachograph) tətbiqi və bununla əlaqədar Azərbaycanın Rəqəmsal Taxoqraf Sistemində tələb olunan zəruri dəyişikliklər də müzakirə edilib. Bildirilib ki, bununla əlaqədar fabrikin nümayəndələri müvafiq tədbirlər görüldükdən sonra Azərbaycan tərəfini məlumatlandıracaqlar.</p>\r\n<p>Eyni zamanda, Azərbaycan Respublikası Nazirlər Kabinetinin 2016-cı il 10 mart tarixli 118 nömrəli qərarı ilə təsdiq edilmiş \"Ümumi istifadədə olan avtomobil nəqliyyatı ilə ölkədaxili sərnişin və yükdaşımalarını yerinə yetirən sürücülərin iş və istirahət rejiminə, iş şəraitinin xüsusiyyətlərinə dair Qaydalar\" barədə fabrikin nümayəndələrinə məlumat verilib və bu qaydalardan irəli gələn müvafiq rəqəmsal taxoqraf sisteminin yaradılması məsələləri müzakirə olunub.</p>\r\n<p>Görüşün sonunda bağlanmış müqaviləyə əsasən, Polşanın Qiymətli Kağızlar İstehsalı Fabrikinin səlahiyyətli şəxslərinə paytaxt Varşava şəhərində Azərbaycan Respublikasının Milli Açarlarının təhvil verilməsi təmin edilib.</p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'suruculere-taxoqraf-sistemi-ile-nezaret-olunacaq', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/16\\/surucu_kurslarina_yeni_duzenleme_1548753949_0636.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2205', '136', '2019-05-16 07:15:07', '2019-05-16 07:15:07', 'Dronun idarəetməsini 10 dəqiqə ərzində ələ keçirmək mümkündür', '\r\n<p><b>Chip.az<i> </i></b><i></i>xəbər verir ki, o, bunu, pilotsuz qurğunun proqram təminatında aşkarladığı təhlükəli protokollar vasitəsilə etdi. Bu təcrübənin məqsədi - əşyaların internetini istehsal edən (dronlar, videodayələr, ağıllı məişət texnikası, ağıllı ev sistemləri, şəbəkəyə qoşulan oyuncaqlar və s.) şirkətlərin diqqətini məhsullarını qorumaq üçün ciddi tədbirlər görməyə çağırmaqdır. “Kaspersky Lab”, istifadəçiləri ağıllı cihazları alarkən onların necə qorunduğunu və mümkün riskləri qiymətləndirməklərini məsləhət görür.</p>\r\n<p>\"Bir çox internet əşyaları istehsalçıları öz məhsullarını bazara gətirməyə çalışır və səylərini satışların artmasına yönəldir. Yalnız mənfəəti güdərək şirkətlər təhlükəsizlik məsələrinə ya kifayət qədər ciddi yanaşmırlar və ya ümumiyyətlə iqnor edirlər, baxmayaraq ki, hakerlərin ağıllı qurğulara böyük marağı var. Bu cihazların kibermüdafiəsi haqqında düşünmək inkişafın erkən mərhələlərində çox vacibdir, çünki əşyaların internetinə nəzarət, təcavüzkarların cihaz sahiblərinin şəxsi məkanına daxil olmaq, qiymətli məlumatları və əşyaları oğurlamaq, hətta onların sağlamlığı və həyatı üçün təhlükə yarada bilər\"- bunu “Kaspersy Lab” şirkətinin aparıcı antivirus mütəxəssisi Maher Yamut deyib.</p>\r\n<p>\"Dronun proqram təminatında zəifliyini tapmaq və üzərində tam nəzarət əldə etmək üçün mənə 10 dəqiqədən az vaxt lazım oldu. Bunu digər internet cihazları ilə də etmək olar. Əgər mən bunu asanlıqla etdimsə, deməli cinayətkarlar üçün də çətin olmayacaq. Nəticələr isə dəhşətli ola bilər. Görünür ağıllı cihazların istehsalçıları onların təhlükəsizliyinin kifayət qədər qayğısına qalmır. Onlar istifadəçiləri zərərlihücumlardan qorumaq üçün cihazlara təhlükəsizlik həllərini quraşdırmalıdırlar.” - deyə Ruben Pol bildirib.</p>\r\n<p style=\"text-align: right;\"><b style=\"text-align: right;\">Chip.az</b></p>', 'dronun-idareetmesini-10-deqiqe-erzinde-ele-kecirmek-mumkundur', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/16\\/DronesTeaser.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2206', '96', '2019-05-16 08:02:44', '2019-05-16 08:02:44', 'Oppo yeni dizaynlı modellerini təqdim edib', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, dünən “OnePlus 7” modelinin təqdimatından sonra bu gün də Çin markasına məxsus telefon xəbərləri yayıldı. “Oppo”nun yeni orta seqment telefonu “Realme X” iki fərqli versiyada -  “Garlic Edition” (Sarımsaq versiyası) və “Onion Edition” (Soğan versiyası) təqdim olunub. Telefonların dizaynı  isə Naoto Fukasavaya məxsusdur.</p>\r\n<p>Telefonun xüsusiyyətlərinə nəzər yetirsək ikili sim kartdan, Qualcomm Snapdragon 710 çipindən, 6.53 düymlük FHD + AMOLED ekranından, ekranda quraşdırılmış barmaq izi oxuyucusundan, ikili arxa kamera və sürüşkən ön kamera sistemindən ibarət olduğunu görə bilərik. Eyni zamanda 3.765 mAh batareya, həmçinin 20 W VOOC 3.0 sürətli batareya dəstəyi də mövcuddur. Sürətli batareya sistemi yarım saat ərzində 55% enerji doldurulmasını təmin edir.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/a757375774252361a784ad944a441a801a4d64cf.jpeg\" /></p>\r\n<p>Telefonun 16 meqapikselli ön kamerası f / 2.0 diapazon dəyərinə və OnePlus 7  modelində istifadə olunan Sony IMX471 sensoruna malikdir. Telefonun arxa kameralarının əsas sensoru 48 MP, f / 1.7 diapazonundadır.  Və Sony-nin IMX568 sensorundan istifadə olunur. İkincik kamera 5 MP-lik dəyərində f / 2.4 diapazonunu təşkil edir.  Əsas kamera isə 4K 30 fps və ya 720p 960 fps ölçsündə video çəkə bilər.</p>\r\n<p><strong>Telefonların qiymətləri ilə tanış ola bilərsiniz :</strong></p>\r\n<p>4GB RAM, 64 GB daxili saxlama: 217,92 $</p>\r\n<p>8 GB RAM, 128 GB daxili saxlama: 261,53 $</p>\r\n<p>Mavi və ağ rəngdə təqdim olunan telefonun Naoto Fukasawanın müəllifi olduğu “Sarımsaq” və “Soğan” modelləri 100 dollar daha bahadır. 20 Mayda Çində satışa çıxarılacaq telefonun Avropada da satışa təqdim ediləcəyi gözlənilir. Ancaq sözü gedən modellərin Çin xaricində satışa təqdim ediləcəyi hələki dəqiq deyil.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'oppo-yeni-dizaynli-modellerini-teqdim-edib', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/16\\/oppo-realme-x-sarimsak-ve-sogan-modelleriyle-geliyor-1557943843.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2207', '96', '2019-05-16 08:54:05', '2019-05-16 08:54:05', 'Facebook bu istifadəçilərin hesablarını blok edəcək', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, ötən ay Yeni Zelandiyada iki məscidə hücum edilib. Təcavüzkar bu anları \"Facebook\" vasitəsilə canlı yayımlamışdı. 49 nəfərin həyatını itirdiyi bu hücumdan sonra \"Facebook\" yayım qaydalarını dəyişdirməyi qərara alır. Bundan sonra \"Facebook\" vasitəsilə canlı yayımlarda qaydalara əməl olunmazsa, istifadəçilər müvəqqəti olaraq əngəllənəcək. Müvəqqəti qadağanın müddəti isə istifadəçinin hansı qaydaların üstündən ötüb keçdiyinə görə müəyyənləşəcək.</p>\r\n<p><img src=\"https://cdn.webtekno.com/media/cache/content_detail_v2/article/68649/facebook-canli-yayin-politikasini-sikilastiriyor-1557918758.jpg\" alt=\"Facebook, Canlı Yayın Kurallarını İhlal Eden Kullanıcıların Hesaplarını Engelleyecek ile ilgili görsel sonucu\" /></p>\r\n<p>\"Facebook\" bu yenilik ilə paralel olaraq süni intellekt üzərində işlər aparılmasını da davam etdirir. ABŞ-ın Cornell və Kaliforniya universitetləri ilə razılaşdırılan müqavilənin nəticəsi olaraq video axınların idarə olunması üçün xüsusi video analiz üsullarının tətbiq olunacağı bildirilib. Müqavilənin “Facebook”a məxsus maliyyə dəyəri 7,5 milyon dollar təşkil edir.</p>\r\n<p>Mövzuyla əlaqədar açıqlama verən \"Facebook\" Product Management idarə heyətinin rəhbəri Guy Rosen bununla \"Facebook\" və \"Facebook\" istifadəçilərinin canlı yayım xüsusiyyətinin təhlükəsizliyini artıraraq insanları mənfi hadisələrə qarşı qorunmaq istədiklərini qeyd edib. Bundan başqa Rosen “Facebook”un daha təhlükəsiz bir platforma olması üçün bir sıra yeniliklərin tətbiq olunacağını da vurğulayıb.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'facebook-bu-istifadecilerin-hesablarini-blok-edecek', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/16\\/d88f5e254168fcd5c228afd70b2e165e7d2fa883.jpeg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
