ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2209', '96', '2019-05-16 10:57:43', '2019-05-16 10:57:43', 'RedmiBook 14-ün özəllikləri açıqlandı', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, sərfəli qiymətə və fərqli performansa malik telefonları ilə gündəmdə qalan Çin şirkəti hər ötən gün sektorda yerini möhkəmlətməyə davam edir. Belə ki, ağıllı telefon bazarı sərhədlərini aşmağı hədəfləyən “Xiaomi”nin alt markası “Redmi”yə məxsus  ilk dizüstü kompüterin texniki xüsusiyyətlərinin detalları açıqlanıb.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/08d03742d24b25ad7b636d01545090143d8e5fc7.jpeg\" /></p>\r\n<p>Təqdim ediləcəyi gözlənilən “Redmi K20” telefonu ilə bərabər “RedmiBook 14”ün də nümayiş olunması nəzərdə tutulub. Adından bəlli olduğu kimi model tam 14 düymlük ekrana sahibdir. Intel Core i3, Core i5 və Core i7 variantları ilə satışa çıxarılacaq “RedmiBook 14”ün özəl xüsusiyyəti xarici qrafik interfeysə (GPU) sahib olmasıdır.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/68600697e5ae5cd4a23715f8aa1cb90785c17adc.jpeg\" /></p>\r\n<p>Eyni zamanda 4 GB RAM, 128GB və 256GB daxili yaddaş saxlama qabiliyyətinə malik olacaq.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/497f948ba98b88695d316a68f2cf8f397fc03ea4.jpeg\" /></p>\r\n<p>Sadəcə gümüş rəng seçimi ilə satışa çıxarılacaq “RedmiBook 14”ün qiyməti haqqında hər hansısa məlumat verilməyib.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'redmibook-14-un-ozellikleri-aciqlandi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\"