ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2210', '96', '2019-05-16 12:02:49', '2019-05-16 12:02:49', 'Azərbaycanda internet xidmətinə görə aylıq ödəmələrin vaxt məhdudiyyətində dəyişiklik edilib ', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, bu aydan şirkətin göstərdiyi internet xidməti üzrə ödənişlər “gündəlik hesablaşma” prinsipi ilə aparılacaq.</p>\r\n<p>Belə ki, artıq ödəniş günü hər ayın 5-nə qədər deyil, sonuncu ödəniş edilən gündən sonrakı 30-cu təqvim günü gələn ay üçün ödəmənin son günü müəyyən ediləcək. Hazırda isə cari ay üçün ödəniş olunmadığı təqdirdə internet xidməti dayandırılacaq.</p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'azerbaycanda-internet-xidmetine-gore-ayliq-odemelerin-vaxt-mehdudiyyetinde-deyisiklik-edilib', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/16\\/internet.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_statu