ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2211', '96', '2019-05-16 12:32:03', '2019-05-16 12:32:03', 'Instagram mesajlaşma funksiyasını ləğv edir', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, fotoşəkil paylaşım mikrobloqu olan Instagram gələn aydan etibarən birbaşa mesajlaşma proqramını aradan qaldıracaq. Burada söhbətlər itməyəcək lakin Instagram tətbiqinə ötürüləcək.</p>\r\n<p>Sosial media sektorunda araşdırma aparan Matt Navara Twitter paylaşımında istifadəçilər “Instagram”a daxil olduqları zaman bir xəbərdarlıq mesajı ilə qarşılaşacaqlarını bildirib. “Instagram” directin də ləğv edilməsi fikri buradan qaynaqlanıb.</p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n<p>“Instagram”ın bu tətbiqi sosial media platformasının populyarlaşması cəhətdən yenilik yaratmadı və bir o qədər də tələbat olduğunu görmədilər. İstənilən halda tətbiqin hansı səbəblərdən aradan qaldırılması barədə heç bir açıqlama verilməyib. Tətbiqin “Facebook Messenger”ə köçürülməsi ehtimalı var.</p>\r\n<p>Direct tətbiqinin 2017-ci ilin dekabrnda Çili, İsrail, İtaliya, Portuqaliya, Türkiyə və Urugvayda sınaqdan keçirilərək istifadəyə verilmişdi.  Daha sonra dünya səviyyəsində yayılması planlaşdırılırdı.</p>\r\n<p>Instagram rəsmiləri dörd il ərzində platformanın bir hissəsi olan mesajlaşma xüsusiyyətinin ayrıca proqram kimi təqdim olunmasının daha effektli olacağını bildiriblər. Hələki bu barədə daha geniş məlumat açıqlanmayıb.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'instagram-mesajlasma-funksiyasini-legv-edir', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/16\\/unnamed.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2212', '96', '2019-05-16 12:48:56', '2019-05-16 12:48:56', 'Digital HUB proqramının yaradacağı imkanlar müzakirə olundu', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, tədbirdə tələbələrə dördüncü sənaye inqilabı şəraitində rəqəmsallaşma, Azərbaycanın rəqəmsal mərkəzə çevrilməsi üçün “AzerTelecom” şirkəti tərəfindən icra edilən “Azerbaijan Digital Hub” proqramı və onunölkəmiz üçün üstünlükləri, rəqəmsallaşma dövründə gənclərin təhsili vəkaryera seçimibarəsində faydalı fikir mübadiləsi aparılıb.</p>\r\n<p>“AzerTelecom” şirkətinin Baş icraçı direktoru Fuad Allahverdiyev çıxışında rəqəmsallaşma şəraitində gənclərin qarşısında mühüm imkanların açıldığını bildirib, ölkəmizin rəqəmsal mərkəzə çevrilməsi üçün “AzerTelecom” şirkətinin icra etdiyi “Azerbaijan Digital Hub” proqramı barəsində ətraflı danışıb. Fuad Allahverdiyev “Digital HUB” proqramının ölkə iqtisadiyyatı, xüsusilə də informasiya və kommunikasiya texnologiyaları sektorunun davamlı inkişafı üçün yaradacağı imkanlardan bəhs edib, İT sahəsi üzrə ölkədə gənc kadrlara böyük tələbatın olduğunu, “Digital HUB” proqramının əsas məqsədlərindən birinin də məhz İT sahəsində yerli kadrların yetişdirilməsi, yeni iş yerlərinin açılması, ölkədən beyin axının qarşısının alınması olduğunu qeyd edib. O ixtisaslı kadrların yetişdirilməsi üçün özəl sektorun təhsil müəssisələri ilə sıx əməkdaşlığının vacibliyini vurğulayıb.</p>\r\n<p>Digər çıxış edənlər - Azərbaycan Texniki Universitetinin kaferda müdiri, professor Mehman Həsənov, Bakı Dövlət Rabitə və Nəqliyyat Kollecinin direktoru Bəxtiyar Bəxtiyarov,tanınmış biznes kouç, təlimçi və həkim-psixiatr Həlimə Qəmərlinskaya, tədbirin moderatoru, kollecin müəllimi Oqtay Əliyev və insan resurslarının idarə edilməsi sahəsində digər tanınmış ekspertlər İKT sahəsində müasir trendlər, tələbələrin düzgün ixtisas seçimimövzularında danışıblar, həmçinin kolleclə “AzerTelecom” şirkəti arasında əməkdaşlığın vacibliyini vurğulayıblar.</p>\r\n<p>“AzerTelecom” şirkəti Azərbaycanın ilk mobil operatoru “Bakcell” şirkətinin törəmə müəssisəsidir və 2008-ci ildə təsis edilib. Şirkət telekommunikasiya sektorunda yerli və xarici şirkətlərə müxtləlif qabaqcıl xidmətlər təqdim edir. “AzerTelecom” hazırda Azərbaycanın sahib olduğu Enerji və Nəqliyyat Mərkəzi statuslarına əlavə olaraq ölkənin Regional Rəqəmsal Mərkəzə çevrilməsi üçün “Azerbaijan Digital Hub” proqramını icra edir. “Digital Hub” proqramının məqsədi ölkəni Qafqaz, MDB, Orta və Cənubi Asiya, Yaxın Şərq və ətraf regionlar üçün Rəqəmsal Mərkəzə çevirməkdir.<br /><br /><img src=\"https://scontent.fgyd4-2.fna.fbcdn.net/v/t1.15752-9/60355734_441247886438085_4043163203205595136_n.jpg?_nc_cat=102&amp;_nc_ht=scontent.fgyd4-2.fna&amp;oh=25f94f6bb8397c9f783d31fc2de79c69&amp;oe=5D72F279\" width=\"1310\" height=\"989\" /></p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'digital-hub-proqraminin-yaradacagi-imkanlar-muzakire-olundu', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/16\\/3.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2213', '96', '2019-05-16 13:29:20', '2019-05-16 13:29:20', 'Lilium şirkətinə məxsus ilk uçan taksi (Video)', '\r\n<p>Elektrik enerjisi ilə çalışan nəqliyyat vasitələri son illərin ən məşhur məhsullarından biridir. Elektrik enerjisi ilə işləyən avtomobillər gündəmdə olsa da, aviasiya sahəsində də bu istiqamətdə olduqca fərqli və maraqlı işlər aparılır. Bu siyahıya elektriklə hərəkət edən kiçik təyyarələr, uça bilən digər cihazlar daxildir.</p>\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Lilium” şirkəti də 2016-cı ildən etibarən bu sahədə fəaliyyət göstərən qurumılardan biridir.  Adı çəkilən şirkət beş nəfərə qədər şəxsin yerləşə biləcəyi bir elektrik vasitəsinin istehsalı ilə məşğul olur. Şirkət bu istiqamətdə əhəmiyyətli bir addım atdı və ilk dəfə “Lilium” vasitəsinin  tam ölçülü prototipini hazırlaya bildi.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/239624c89c0fae623600429d9a72069dddbc5862.jpeg\" /></p>\r\n<p>Alman şirkəti Avropa Kosmik Agentliyinin inkubasiya proqramının təşəbbüsü olaraq şəhər nəqliyyatı üçün təmiz və effektli həll yolu tapmağı hədəfləyirdi. Əlbəttə ki, bu problemin tək həlli yolu yoxdur. Amma “Lilium”un yanaşması olduqca diqqətəlayiqdir. Telefonla çağırılacaq uçan bir taksi əhəmiyyətli layihələrdən biri kimi düşünülür.</p>\r\n<p>Vasitə şəhərlərdə və müəyyən bölgələrdə quraşdırılacaq müvafiq ərazilərə düşəcək. Beləliklə sərnişinlər istədikləri nöqtəyə şəhər trafikindən uzaqlaşaraq rahat şəkildə çata biləcəklər. Ayrıca olaraq karbon qazını ətrafa yaymaması  vasitənin özəlliklərindən biridir. Bu cihazların vasitəsi ilə səyahət çox qısa müddətdə davam edəcək. Məsələn avtomobil ilə  55 dəqiqəyə gedilən yola  bu cihaz sayəsində yalnız 5 dəqiqə sərf etmək lazım olacaq.</p>\r\n<p>İzlənilə bilən bir enmə cihazına,  xüsusi nəzarət mexanizminə malik vasitə təyin edilmiş ərazilərdə hava axınını yönəltməklə vertikal qalxmanı həyata keçirir. Vasitənin bir dəfə enerji ilə təmin olunması sayəsində hazırda qət edə biləcəyi maksimal məsafə 300 km-dir. Maksimal sürəti  də eyni şəkildə 300 kilometr olaraq gerçəkləşir.</p>\r\n<p>Şirkət 2017-ci ildə havada vertikal və şaquli manevr edə bilən iki nəfərlik bir vasitəsi ilə 90 milyon ABŞ dolları məbləğində sərmayə almağa müvəffəq olmuşdur.  Hazırda isə avtomobilin son təqdimatı ilə demək olar ki, vasitənin hazır olduğunu göstərdi.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/02/d4431a33f39ccc82a4a4111ff36462ea7a374186.jpeg\" /></p>\r\n<p>Lilium 2025-ci ilə qədər şəhərlərdə uçan taksiləri n çoxalacağına ümid edir. Gələcəkdə şirkət uçan taksilərin müntəzəm taksilər kimi eyni qiymətlərlə istifadəsini nəzərdə tutur. Ancaq mülki aviasiya agentliyinin buna nə dərəcədə müsbət rəy verməsi sual altındadır.</p>\r\n<p>Aşağıdakı videoda tam ölçülü Lilium uçuşunu izləyə bilərsiniz:</p>\r\n<p><iframe width=\"560\" height=\"314\" src=\"//www.youtube.com/embed/8qotuu8JjQM\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'lilium-sirketine-mexsus-ilk-ucan-taksi-video', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/16\\/ucan-arabalar-gercek-oluyor-lilium-un-ucan-ta-12053879_o.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2214', '96', '2019-05-17 05:43:15', '2019-05-17 05:43:15', 'Space X-ın uçuşu təxirə salındı', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, Elon Muskun təsisçisi və baş icraçı direktoru olduğu “SpaceX” tərəfindən hazırlanan “Falcon 9” raketi şirkətin ultra sürətli internet layihəsini gerçəkləşdirəcək peyklərini (Starlink) orbitiə göndərmək üçün hazırlıqlarını tamamladı. Ancaq hava şəraitinin uyğun olmaması uçuş tarixinin  17 maya keçirilməsinə səbəb oldu.</p>\r\n<p>Floridada Cape Canaveral Hava Qüvvələri Stansiyasında (CCAFS) Space Launch Kompleksindən havaya qalxacaq peyklərin “Falcon 9 Blok 5” raketiyle 550 kilometrlik yüksəklikdəki orbitdə olmağı nəzərdə tutulub.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/5aacf5948f4407d8149e43e95041472ddb8b077a.jpeg\" /></p>\r\n<p>\"Falcon 9\" raketi bununla 71-ci uçuşunu gerçəkləşdirəcək. Bu 2019-cu ildə \"SpaceX\"ın həyata keçirdiyi 6-cı layihəsi olacaq.</p>\r\n<p>\"Space X”ın Əməliyyatlar Şöbəsinin sədri Gwynne Shotwell  \"Satellite 2019\" konfransında bir sıra “Starlink” test peyklərinin antenalar və elektrik ötürücü sistemlərinə sahib olacağını qeyd  edərək peyk daxili əlaqənin olmayacağını bildirib. Bu uçuş sonrakı uçuşlar üçün paylaşdırma strategiyasını sınaqdan keçirmək məqsədi daşıyacaq.</p>\r\n<p>Layihənin tamamilə məqsədinə çatması üçün 420 peyk orbitə yerləşdirilməlidir. İlk funksional peyklərin isə 2020-ci ildə işə salınması gözlənilir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'space-x-in-ucusu-texire-salindi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/17\\/elon-musk-in-uzaydan-internet-projesinin-uydu-12055607_o.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2215', '96', '2019-05-17 07:13:53', '2019-05-17 07:13:53', 'Epic Games Store böyük endirim kompaniyasına başladı', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, sözü gedən şirkət  bu gün ilk böyük endirim kompaniyasını  tətbiq edib. Belə ki, bu gündən etibarən “Epic Mega Sale” adlanan endirim 13 İyuna qədər davam edəcək. “Epic Mega Sale”  boyunca 75% -ə qədər endirimlər təklif olunacaq. Bundan əlavə 13,15 dollar təşkil edən hər oyun 9,86 dollara təklif olunacaq. Bu endirimli alış-verişin təsisçilərə heç bir əlavə gəlir gətirməyəcəyi də bildirilib.</p>\r\n<p>Demək olar ki, “Epic Game Store”da yerləşdirilən hər oyun endirim kompaniyasına daxil olacaq. Hətta pre-satış oyunları da endirimli qiymətlərlə təqdim olunacaq. “Control”, “John Wick Hex”, “Trover” kimi oyunlar mövcud bazara buraxılmadan öncəböyük endirimlərlə satılacaq. Bu xəbər oyun həvəskarları üçün olduqca mükəmməl təkliflərdən oldu.</p>\r\n<p>“Epic Store” hər iki həftədən bir yeni pulsuz oyun təqdim edirdi. Endirim dövründə isə hər həftə pulsuz bir oyunun təklif ediləcəyi açıqlanıb. Pulsuz oyun təqdimatı “Stories Untold” ilə start götürəcək. Digərlərinin adları da qısa zamanda açıqlanacağı bildirilir.</p>\r\n<p><strong>Aida İSAQ</strong></p>', 'epic-games-store-boyuk-endirim-kompaniyasina-basladi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/17\\/a1bad0c2bb22bbbe8142114257699a95c8a48e23.jpeg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2216', '96', '2019-05-17 07:58:11', '2019-05-17 07:58:11', 'Ümumdünya Telekommunikasiya və İnformasiya Cəmiyyəti Günü ilə bağlı tədbir keçiriləcək', '\r\n<p><strong></strong><span><strong>Chip.az</strong> xəbər verir ki, ilk Beynəlxalq Teleqraf  Konvensiyasının (1865) imzalanması və Beynəlxalq Telekommunikasiya İttifaqının (1969) yaranması  da məhz bu günə təsadüf edir. </span><span>Ümumdünya Telekommunikasiya və İnformasiya Cəmiyyəti Gününün builki mövzusu “Standartlaşdırmada fərqliliyin aradan qaldırılması”dır. </span><span>Bu gün Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyi tərəfindən 17 may tarixi ilə bağlı tədbir keçiriləcək.</span><br /><br /><span>Tədbirdə Beynəlxalq Telekommunikasiya İttifaqının Baş katibi Houlin Caonun 17 may - Ümumdünya Telekommunikasiya və İnformasiya Cəmiyyəti Günü ilə bağlı müraciəti diqqətə çatdırılacaq.</span><br /><br /><span>Azərbaycan Standartlaşdırma İnstitutunun (AZSTAND) direktoru Namiq Tağıyev “Rəqəmli transformasiya mühitində standartlaşmanın rolu”, İnformasiya-Kommunikasiya Texnologiyalarının Tətbiqi və Tədrisi Mərkəzinin direktoru Rauf Cabarov “İT mütəxəssisi hazırlığı və sertifikatlaşma”, Elektron Təhlükəsizlik Xidmətinin nümayəndəsi Ləman Hüseynzadə “Standartlar kibertəhlükəsizlik vasitəsi kimi” mövzularında məruzələrlə çıxış edəcək.</span><br /><br /><span>Tədbir çərçivəsində Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyi, Heydər Əliyev Fondu, Təhsil Nazirliyi və İnformasiya Texnologiyaları İnstitutunun birgə təşkilatçılığı ilə baş tutmuş “Ali məktəb tələbələri arasında informatika üzrə XIII Ümumrespublika Olimpiadası”nın qaliblərinin mükafatlandırılması mərasimi keçiriləcək.</span><br /><br /><span>Qaliblər (I-IV yerlər) “Azercell” və “BestComp Group” şirkətlərinin təqdim etdiyi qiymətli hədiyyələr, habelə Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyi tərəfindən Fəxri fərman və diplomlarla təltif olunacaqlar. Eyni zamanda informasiya təhlükəsizliyi üzrə “ISO/IEC 27001:2013 standartı əsasında təlim keçən 15 nəfərə sertifikatlar təqdim olunacaq.</span></p>\r\n<p style=\"text-align: right;\"><br /><strong>Chip.az</strong><span> </span></p>', 'umumdunya-telekommunikasiya-ve-informasiya-cemiyyeti-gunu-ile-bagli-tedbir-kecirilecek', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/17\\/1110854.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2217', '96', '2019-05-17 08:58:12', '2019-05-17 08:58:12', 'Batmanı Robert Pattinson canlandıracaq', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, ən son Ben Affleck tərəfindən canlandırılan obraz haqqında müzakirələrə son qoyuldu. Belə ki, sözü gedən xarakterin Robert Pattinsonun ixtiyarına veriləcəyi elan edilib. Sonrakı Batman filmini yazacağı və idarə edəcəyi gözlənilən Affleckin layihədən ayrılmasından sonra yeni bir komanda yaradılmışdır. Affleck şəxsi səbəblərdən dolayı layihədən ayrıldığını bildirib.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/901497552d67dce15f26db1e2ef0cb7a598e5b26.jpeg\" /></p>\r\n<p>Rejissor Matt Reeves filmin senarisinin Batmanən  ilk dəfə ortaya çıxdığı zamanlara fokuslanacağını açıqlamışdı. Batmanın dünyanın ən yaxşı dedektif olduğunu ancaq bunun əvvəlki filmlərdə ön plana çıxarılmadığını qeyd edən Reeves noir üslubunda və Batmannın dedektiflik qabiliyyətinə yönələn bir film çəkiləcəyini vurğulayıb.</p>\r\n<p>Bu ilin sonlarında çəkilişlərinə başlanılacaq filmdə digər yer alacaq aktyorların adlarıda yaxın zamanlarda elan olunacağı gözlənilir.</p>\r\n<p>Məlumatlara görə Pattinson hələ müqaviləni  imzalamayıb və aktyor Nicholas da Hoult Batman rolunu canlandırmağa namizəd olması ehtimalı var.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/7beb5b55dd869af8a11dfdc7a7e75c2fb71a6638.jpeg\" /></p>\r\n<p>Reevesin sözlərinə görə film Aquaman, Joker və Shazamdan çox fərqli olacaq. Yeni Batman filmi 2021-ci il iyunun 21-də təqdim olunacaq.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'batmani-robert-pattinson-canlandiracaq', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/17\\/Robert-Pattinson-Batman (1).jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2218', '96', '2019-05-17 10:36:50', '2019-05-17 10:36:50', 'Asus Zenfone 6 modeli təqdim edildi', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, 9.2 mm incəliyində olan telefon 6.4 düymlük ekranın yuxarı hissəsində yerləşən oyuq olmayan ekran ilə istifadəyə verildi.  Asus ön kameranı  ekranın üst hissəsindən aradan qaldıraraq 48 MP + 13 MP dəyərində iki kameranı tətbiq etdi. Başqa sözlə telefonun arxa kamerası ön kamera kimi də istifadə edilə bilər.</p>\r\n<p>Qatlana bilən ön kamera dayanıqsız kimi görünsə də “Asus” ön kameranın mexanizmini yetərincə sınaqdan keçirib. Telefonun ön kamerasının 100,000 dəfə yoxlanıldığını bildirən şirkət gündə təqribi 28 selfie edən birinin 5 il boyunca heç bir problemlə qarşılaşmayacağına zəmanət verir.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/e676327ecddfca27dcdd20c341b131830b7c7ac9.jpeg\" /></p>\r\n<p>Bundan əlavə saniyədə 60 görüntü və 4K video çəkə biləcəyiniz telefon selfie rejimində olduğu zaman görüntü sabitləyici funksiyasından da yararlanmaq mümkündür . Panorama, hərəkət izləyici, təkmilləşdirilmiş HDR + və gecə rejimi də kameranın xüsusiyyətləri sırasına daxildir.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/4bc63d9f028e2bdedabe3f3bc2c019a96d09f07c.jpeg\" /></p>\r\n<p>6.4 düymlü IPS LCD ekranı telefonun 92% -ni təmsil edir. Ekran həmçinin Gorilla Glass 6 tərəfindən qorunur.  Telefonun arxasında barmaq izi oxuyucusunun olduğunu da müşahidə edə bilərik.</p>\r\n<p>Telefon Snapdragon 855 ilə təchiz edilib və 8 GB RAM və 256 GB daxili yaddaşa sahibdir. Bundan əlavə “Asus” yaddaş kartları yaxud ikinci SIM kartı yerləşdirmək arasında seçim variantı etmək əvəzinə ikili SIM və yaddaş kartlarını quraşdırmaq üçün 3 yuva tətbiq edib.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/266c77a89816936e01f7a076e00d2c6bb545bb1a.jpeg\" /></p>\r\n<p>Telefonun gücünə nəzər yetirsək böyük bir 5,000 mAh batareyanı görə bilərik. 18W-luq bir enerji sürətinə malik cihaz naqilsiz yükləmə rejimini dəstəkləməsə də şirkət telefonun batareyasının daha uzun ömürlü olması üçün belə təşkil olduğunu bildirib.</p>\r\n<p>Avropada satışa çıxarılacaq model  500 avroya təklif olunacaq. 23 Mayda Asus.com və ya rəsmi mağazalardan əldə oluna bilər.</p>\r\n<p><em><strong>“Asus Zenfone 6” modelinin xüsusiyyətləri:</strong></em></p>\r\n<p>Ekran: 6.4 düymlü IPS LCD, Corning Gorilla Glass 6</p>\r\n<p>Çipset: Qualcomm Snapdragon 855</p>\r\n<p>Prosessor: Kryo 485 və 3x2,41 GHz Kryo 485 və 4x1,78 GHz Kryo 485 səkkiz nüvəli (1x2,84 GHz</p>\r\n<p>Arxa / ön kamera: 48 MP f / 1.8 geniş bucaqlı linza OIS + 13 MP f / 2.4 ultra geniş bucaqlı linza</p>\r\n<p>RAM: 8 GB</p>\r\n<p>Daxili yaddaş: 256 GB</p>\r\n<p>Batareya: 5,000 mAh</p>\r\n<p>Qulaqlıq girişi: Var</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'asus-zenfone-6-modeli-teqdim-edildi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/17\\/asus-zenfone-6-tanitildi-iste-ozellikleri-ve-fiyati-1558035074.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2219', '96', '2019-05-17 11:38:44', '2019-05-17 11:38:44', 'Line proqramına yeni xüsusiyyət əlavə olundu', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, yaxın günlərdə <span>istifadəçilər sözü gedən </span>yeniləmə ilə öz hekayələrini mövcud proqramda paylaşa biləcəklər. Yaponiyada və Asiyada ən populyar mesajlaşma proqramı olan \"Line\" yeniliklər tətbiq edərək istifadəçilərin diqqətini üzərindən çəkməməyə çalışır.</p>\r\n<p><img src=\"https://cdn.webtekno.com/media/cache/content_detail_v2/article/68750/kaybolan-hikayeler-kervanina-line-da-katiliyor-1558077838.jpg\" alt=\"Mesajlaşma Uygulaması Line\'a da Hikayeler Özelliği Geliyor ile ilgili görsel sonucu\" /></p>\r\n<p>İlk olaraq “Snapchat”ın tətbiq etdiyi amma sonra digər platformaların özəlləşdirdiyi bu funksiyadan istifadə etməyən proqram qalmadı desək yanılmarıq. Məlum olduğu kimi “WhatsApp”, “Facebook”, “Messenger” da daxil olmaqla demək olar ki, bütün mesajlaşma proqramları bu xüsusiyyətlə istifadəçiləri sevindirməkdə davam edir.</p>\r\n<p>İstifadəçilərin paylaşacağı bu hekayələrin 24 saatdan sonra avtomatik silinəcəyi bildirilib. 2019-cu ildə aylıq 164 milyon istifadəçisi olan \"Line\" bu yeniliklə auditoriyasını  artırmağı və bununla daha böyük gəlir əldə etməyi hədəfləyir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'line-proqramina-yeni-xususiyyet-elave-olundu', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/17\\/600x338Mesajlasma-uygulamasi-Linea-kripto-para-destegi-geliyor.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2220', '96', '2019-05-17 12:21:55', '2019-05-17 12:21:55', 'Sony və Microsoft birgə əməkdaşlıq edəcək', '\r\n<p><strong>Chip.az</strong><span> </span>xəbər verir ki, “Xcloud” və “PlayStation” inkişaf etdirmək üçün bir araya gələn iki nəhəng şirkət bir-birinin imkanlarından faydalanacaq.</p>\r\n<p>Mövzuyla bağlı danışan “Sony”nin baş icraçı direktoru Kenichiro Yoshida “PlayStation”u əlverişli bulud mühitində heç bir problem olmadan təkmilləşdirməyi hədəflədiklərini söyləyib. “Microsoft” ilə işləməkdən məmnunluğunu ifadə edən Yoshida hər iki şirkətin ən son texnologiyalarını ortaq bir məqsədlə istifadə edilməsinin istifadəçilər üçün də ən yaxşısı olduğunu qeyd edib.</p>\r\n<p>“Microsoft”un baş direktoru Satya Nadella :</p>\r\n<p>\"Sony həm əyləncə sənayesində həm də texnologiyasında hər zaman lider olmuşdur. Gerçəkləşdirilən tərəfdaşlığın da səbəbi budur. Yəni müştərilərə daha yaxşı və yeni oyun nümunələrini təqdim etmək üçün “Sony”nin Azure AI-in gücündən istifadə ediləcək\".</p>\r\n<p>Həm əyləncə həm də texnologiya sənayesinin iki nəhəng şirkətinin ortaq məqsəd üçün bir araya gəlməsi çox yaxşı bir xəbərdir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'sony-ve-microsoft-birge-emekdasliq-edecek', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/17\\/z1.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2221', '96', '2019-05-17 12:49:36', '2019-05-17 12:49:36', 'Volvo avtomobillər üçün qəza məsləhətçisi xidmətini təklif edir', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Volvo” mobil tətbiqetməsinə yeni bir xüsusiyyət əlavə etdi. Telematik texnologiyasının tətbiq olunduğu bu proqram sayəsində istifadəçilər vasitələri ilə bağlı məlumatları telefonları ilə əldə edə bilirdilər. Hər hansısa qəza zamanı bu proqram vasitəsilə “Volvo” mərkəzi ilə  birbaşa əlaqə qurmaq mümkündür. Yeni xüsusiyyət sayəsində “Volvo” istifadəçiləri qəza zamanı müvafiq mərkəzə qoşularaq nə etməli olduqları haqqında məlumat ala bilərlər.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/87d032ca2b58c381bbf4511366b0434575ef21bb.jpeg\" /></p>\r\n<p>Mobil proqramdan “Qəza Məsləhətçisi” bölməsini seçən vasitə sahibi ilk növbədə vəziyyəti haqqında məlumat verir. Daha sonra operatorun köməyi ilə əlaqə yaradılır. Bu əlaqə sayəsində vasitənin sahibi sistemə qəza ilə bağlı lazımi məlumatları daxil edir. Belə ki, avtomobilin fotosunu, qəzanın necə baş verdiyi haqqında məlumatı və ünvanını birbaşa sığorta şirkətinə göndərir. Vasitə sahibi qəza məsləhətçisinin köməyi ilə ən yaxın təmirçilərə müraciət edə bilər.</p>\r\n<p>Bir “Volvo” sahibi olsanız aşağıdakı “Volvo”nun mobil tətbiqinə daxil ola bilərsiniz:</p>\r\n<p><a href=\"https://itunes.apple.com/tr/app/volvo-on-call/id439635293?l=tr&amp;mt=8\">https://itunes.apple.com/tr/app/volvo-on-call/id439635293?l=tr&amp;mt=8</a> </p>\r\n<p><a href=\"https://play.google.com/store/apps/details?id=se.volvo.vcc&amp;hl=en\">https://play.google.com/store/apps/details?id=se.volvo.vcc&amp;hl=en</a> </p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'volvo-avtomobiller-ucun-qeza-meslehetcisi-xidmetini-teklif-edir', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/17\\/volvo-nun-mobil-uygulamasi-artik-kaza-danisma-12057314_o.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2222', '96', '2019-05-17 13:15:46', '2019-05-17 13:15:46', 'Şəhid ailələri övladları üçün ödənişsiz Front-End proqramlaşdırma kursu', '\r\n<p><span><strong>Chip.az</strong> xəbər verir ki, Matrix bu dəfə şəhid ailələrinin övladları üçün ödənişsiz olaraq nəzərdə tutulmuş yeni Front-End proqramlaşdırma qruplarına qeydiyatı açıq elan edir.</span></p>\r\n<p>Dərslər həftədə 2 dəfə hər dərs 2 saat olmaqla tədris olunacaq. Dərslər 10 moduldan ibarət olmaqla tədris olunacaq. Bu period ərzində sıfırdan HTML, CSS, JS fundamental biliklərin mənimsədilməsi, portfolio ola biləcək işlərin görülməsi planlaşdırılmışdır.</p>\r\n<p>Yerlər məhduddur. İlk qruplara maksimum 20 tələbə seçiləcəkdir.</p>\r\n<p>Qeyd edək ki, qeydiiyyat 5 iyun tarixinə qədər davam edəcək.</p>\r\n<p>Qeydiyyat linki</p>\r\n<p><a href=\"https://bit.ly/2YyBKHS\">https://bit.ly/2YyBKHS</a> </p>\r\n<p>Əlaqə : 055 654 29 74<br /><a href=\"mailto:office@matrix.co.az\">office@matrix.co.az</a></p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'sehid-aileleri-ovladlari-ucun-odenissiz-front-end-proqramlasdirma-kursu', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/17\\/60337745_2220517631597032_4037137578837671936_n.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2223', '96', '2019-05-18 05:17:18', '2019-05-18 05:17:18', 'Ümumdünya Telekommunikasiya və İnformasiya Cəmiyyəti Günü qeyd olunub', '\r\n<p>İlk Beynəlxalq Teleqraf Konvensiyasının (1865) imzalanması və Beynəlxalq Telekommunikasiya İttifaqının (1969) yaranması da məhz bu günə təsadüf edir. Ümumdünya Telekommunikasiya və İnformasiya Cəmiyyəti Gününün builki mövzusu “Standartlaşdırmada fərqliliyin aradan qaldırılması”dır.</p>\r\n<p><strong>Chip.az</strong> xəbər verir ki, Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyinin bu gün keçirdiyi tədbir də bu mövzuya həsr olunub.</p>\r\n<p>Tədbiri giriş sözü ilə açan nəqliyyat, rabitə və yüksək texnologiyalar nazirinin müavini Elmir Vəlizadə bu günün əhəmiyyətini qeyd edib. Standartlaşdırma üzrə fərqliliyin aradan qaldırılmasının İKT-nin cəmiyyətdə rolu, iqtisadi və sosial inkişafa təsiri barədə məlumat verib.</p>\r\n<p>Qeyd edək ki, “Azərbaycan Respublikasında informasiya cəmiyyətinin inkişafına dair 2014-2020-ci illər üçün Milli Strategiya” və “Azərbaycan Respublikasında informasiya cəmiyyətinin inkişafına dair Milli Strategiyanın həyata keçirilməsi üzrə 2016-2020-ci illər üçün Dövlət Proqramı” 2016-cı ildə təsdiq olunub.</p>\r\n<p><img src=\"http://ictnews.az/uploads/IMG_3958.JPG\" /></p>\r\n<p>Tədbirdə Beynəlxalq Telekommunikasiya İttifaqının Baş katibi Houlin Caonun 17 may – Ümumdünya Telekommunikasiya və İnformasiya Cəmiyyəti Günü ilə bağlı müraciəti diqqətə çatdırılıb.</p>\r\n<p>Azərbaycan Standartlaşdırma İnstitutunun (AZSTAND) direktoru Namiq Tağıyev “Rəqəmli transformasiya mühitində standartlaşmanın rolu”, İnformasiya-Kommunikasiya Texnologiyalarının Tətbiqi və Tədrisi Mərkəzinin direktoru Rauf Cabarov “İT mütəxəssisi hazırlığı və sertifikatlaşma”, Elektron Təhlükəsizlik Xidmətinin nümayəndəsi Ləman Hüseynzadə “Standartlar kibertəhlükəsizlik vasitəsi kimi” mövzularında məruzələrlə çıxış ediblər.</p>\r\n<p>Tədbir çərçivəsində Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyi, Heydər Əliyev Fondu, Təhsil Nazirliyi və İnformasiya Texnologiyaları İnstitutunun birgə təşkilatçılığı ilə baş tutmuş “Ali məktəb tələbələri arasında informatika üzrə XIII Ümumrespublika Olimpiadası”nın qaliblərinin mükafatlandırılması mərasimi keçirilib.</p>\r\n<p>Olimpiadanın yekunlarına görə, 1-ci yerə Bakı Mühəndislik Universitetinin “BEU Programmers” komandası, 2-ci yerə M.V.Lomonosov adına Moskva Dövlət Universitetinin Bakı filialının “MSU_BAKU_3” komandası, 3-cü yerə ADA Universitetinin “ADA-Firi-J” komandası, 4-cü yerə isə Azərbaycan Dövlət Neft və Sənaye Universitetinin “ADNSU 1” komandası layiq görülüb.</p>\r\n<p>Qaliblər (I-IV yerlər) “Azercell” və “BestComp Group” şirkətlərinin təqdim etdiyi qiymətli hədiyyələr, habelə Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyi tərəfindən Fəxri fərman və diplomlarla mükafatlandırılıb.</p>\r\n<p>İnformasiya təhlükəsizliyi üzrə<span> </span><b>ISO/IEC 27001:2013</b><span> </span>standartı əsasında təlim keçən 15 nəfərə sertifikatlar təqdim olunub.</p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'umumdunya-telekommunikasiya-ve-informasiya-cemiyyeti-gunu-qeyd-olunub', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/18\\/iooo.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
