ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2225', '96', '2019-05-18 07:16:05', '2019-05-18 07:16:05', 'Alimlər insan bədənində hərəkət edə biləcək robot hazırlayırlar', '\r\n<p><span><strong>Chip.az</strong> xəbər verir ki, alimlər tərəfindən hazırlanan “uçan balina” adlı bir mini robot bədənimizə daxil olur və dərmanları doğru yerlərə aparır. Xüsusilə xərçəng xəstələri üçün maraqlı olan bu robot hədəf alınan xərçəng hüceyrələrinə doğru hərəkət edərək dərman paylaşımını həyata keçirir. Dəyişkən ölçülərdə yetişdirilən robotların ölçüləri millimetrlərlə ifadə olunur.</span></p>\r\n<p><span><img src=\"https://www.webtekno.com/images/editor/default/0002/03/40dbb896d11554df4611f149a0df141d77f43b82.jpeg\" /></span></p>\r\n<p><span>Hong Kong şəhər universitetində çalışan alimlər tərəfindən hazırlanan uçan balina açılıb bağlanan qanadlara və quyruğa malikdir. Bu xüsusiyyət sayəsində uçan balina qan içində sərbəst hərəkət edə bilər.</span></p>\r\n<p><span>3D printerləri istifadə edərək hazırlanan uçan balinanın bədəni plastik bir quruluşa malik deyildir. Uçan balinanın quyruğu Kardiyomiyosit hüceyrələrlə (ürək əzələsi hüceyrəsi) örtülüdür. Bu da quyruğa hərəkət etməyə imkan verir. Uçan balinanın qanadlarında işığa həssas hidrojeldən istifadə edilmişdir. Bu hidrojelin köməyi ilə qanadların mövqeyi dəyişir.</span></p>\r\n<p><span><strong>Uçan balina necə işləyir?</strong></span></p>\r\n<p><span>Vücudumuzdakı xərçəng hüceyrələri infraqırmızı işıq ilə işıqlandırılır. Uçan balina burada infraqırmızı işıqdan təsirlənərək hidrojelin köməyi ilə qanadlarını bükür. Quyruqda olan ürək əzələsinin qüvvəsi qanadların bükülməsi ilə meydana gələn sürtünmə qüvvəsini aşa bilməz. Beləliklə bu kiçik robot hərəkətsiz qalır və dərmanı həmin bölgəyə buraxır. Mövzuyla bağlı açıqlama verən dosent Zi Chen bu vəziyyəti əl əyləci olan bir vasitənin sürətləndirici pedalına basmağa bənzədir. Testlərdə müvəffəqiyyətli olan bu robotun qanadlarının ayrı-ayrı bükülə bilməsi üçün çalışan alimlər beləcə robotun hərəkətliliyini artırmağı hədəfləyirlər.</span></p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'alimler-insan-bedeninde-hereket-ede-bilecek-robot-hazirlayirlar', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/18\\/bilim-insanlari-insan-vucudu-icinde-hareket-edebilen-bir-robot-yaptilar-1558087779.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2226', '96', '2019-05-18 08:03:35', '2019-05-18 08:03:35', 'Bu il Azərbaycanda istehsal olunan minik avtomobillərinin sayı 430-u ötüb', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, Dövlət Statistika Komitəsinin məlumatına görə, əvvəlki ilin müvafiq dövrü ilə müqayisədə avtomobil, qoşqu və yarımqoşquların istehsalı<span> </span><strong>76,7</strong>%, maşın və avadanlıqların istehsalı<span> </span><strong>12,1</strong>%, sair nəqliyyat vasitələrinin istehsalı isə<span> </span><strong>4,2</strong>% artıb.</p>\r\n<p>Dövr ərzində<span> </span><strong>451<span> </span></strong>ədəd traktor istehsal edilib ki, bu da 2018-ci ilin ilk rübü ilə müqayisədə<span> </span><strong>10,7</strong>% azdır.</p>\r\n<p>Bu ilin birinci rübündə ölkədə<span> </span><strong>436<span> </span></strong>ədəd minik avtomobili istehsal olunub. Bu dövr ərzində ölkədə fəvvarə armaturunun istehsalı<span> </span><strong>53,7</strong>%, ştanqlı quyu nasoslarının istehsalı<span> </span><strong>30,2</strong>%, mancanaq dəzgahlarının istehsalı<span> </span><strong>9,7</strong>% artıb.</p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'bu-il-azerbaycanda-istehsal-olunan-minik-avtomobillerinin-sayi-430-u-otub', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/18\\/3dd8eebe-9c12-4eb4-844d-f7ef73dec500.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2227', '96', '2019-05-18 08:52:20', '2019-05-18 08:52:20', 'Çin hökuməti Wikipediaya girişi əngəllədi', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, bu dəfə giriş maneələrinin sərhədləri bir qədər genişlənib. Belə ki, ölkə daxilində bütün dillərdə xidmət göstərən “Wikipedia”nın bütün dillərə girişi əngəllənib.</p>\r\n<p>Uzun illər Çin hökuməti “Wikipedia”ya müxtəlif yollarla qadağalar tətbiq edirdi. OONI-nin son yayımlanan məlumatlarına görə, aprelin 25-dən etibarən “Wikipedia”nın bütün dillərdə olan səhifələri bağlanıb.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/79b607e9449a4df3b60b8ceb43589c9daaa9ee24.png\" /></p>\r\n<p>Çin hökumətinin bu addımı hansı səbəbdən atması barədə heç bir açıqlama verilmir. Ancaq Tiananmen Meydanı hadisələrinin 30-cu ildönümündən əvvəl tətbiq olunması bəzi suallara cavab verir.</p>\r\n<p>Çin hökuməti “Wikipedia”nın müəyyən səhifələrini blok edə bilirdi. Daha sonra “Wikipedia” təhlükəsiz bir əlaqə protokolu olan HTTPS sisteminə keçdikdə müəyyən bir səhifəni bağlama imkanı qalmadı. Bu səbəbdən Çin hökumətinin bütün səhifəni bir dəfəlik əngəlləmək qərarına gəldiyi ehtimal olunur.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/5cb8a9223c2e2bd2e5d1cad386109b7281d3760f.png\" /></p>\r\n<p>Vətəndaşlar sayta müxtəlif yollarla daxil olmaq üçün çalışırlar. Ancaq bu zaman istifadə olunan DNS giriş və SNI filtrləmə üsulları bu kimi əlaqələrə daxil olmağa icazə vermir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ </strong></p>', 'cin-hokumeti-wikipediaya-girisi-engelledi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/18\\/cin-huk-meti-tum-dillerdeki-wikipedia-sayfalarini-blokladi-1558038385.png\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2228', '96', '2019-05-18 09:10:31', '2019-05-18 09:10:31', 'Google Avroviziya-2019-un mümkün qaliblərinin adlarını açıqladı', '\r\n<p><strong> </strong><strong>Chip.az</strong> xəbər verir ki, bu barədə<span> </span>şirkətin yaydığı press-relizdə məlumat verilir.</p>\r\n<p>“Əgər ölkələrə xallar onların təmsilçilərinin digər dövlətlərin sakinləri tərəfindən nə qədər aktiv axtarılmağına əsasən verilsəydi, siz artıq elə bu gün “Google Axtarış”ın istifadəçilərinin versiyasına görə kimin qalib gələcəyini öyrənə bilərsiniz”, - deyə şirkətin yayımladığı xəbərdə bildirilir.</p>\r\n<div id=\"AdviadNativeVideo0\" class=\"AdviadNativeVideo\">Tərtib olunmuş reytinqə əsasən, qalib olmağa daha çox şansa Fransa təmsilçisi Bilal Hassani malikdir.</div>\r\n<p>İkinci və üçüncü yerlərdə islandiyalı qrup “Hatari” və rusiyalı müğənni Sergey Lazarev qərarlaşıb.</p>\r\n<p>Bundan savayı, ən yaxşıların onluğunda Hollandiya, Belorus, İsveçrə, İtaliya, San-Marino, İsveç və Kipr təmsilçilərinin adları çəkilir.</p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'google-avroviziya-2019-un-mumkun-qaliblerinin-adlarini-aciqladi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/18\\/eurovision-2019-logo.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2229', '96', '2019-05-18 09:49:30', '2019-05-18 09:49:30', ' Starlinkin uçuşu yenidən təxirə salındı', '\r\n<p>Əsas məqsəd  orbitdə yerləşəcək minlərlə internet peyklərinin dünyanın hər yerində insanları naqillərsiz internet əlaqəsi ilə təmin etməkdir.</p>\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Starlink” layihəsində ilk məqsəd 60 peykin orbitə yerləşdirilməsinə nail olmaq idi. Çərşənbə günü göndəriləcək olan “Falcon 9” raketi hava şəraitinin uyğun olmaması səbəbindən təxirə salınır. Növbəti gün yola düşəcəyi gözlənilən raketin peyk  proqramının yenilənməsi və son missiya nəzarətini yoxlamaq məqsədi ilə yenidən  təxirə salınır.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/f0edec2fe7473eb6f9bb34faa420158a8df72606.jpeg\" alt=\"60 Adet Starlink Uydusu\" /></p>\r\n<p><strong>“SpaceX”:</strong></p>\r\n<p>\"Biz peyklərin proqram təminatının yenilənməsini və hər şeyin düzgün olduğunu yoxlamaq üçün gözləyirik. Yerdə görə biləcəyimiz bütün işləri dəqiqliklə etmək istəyirik. Növbəti uçuş 1 həftə ərzində reallaşacaq”</p>\r\n<p>Əlbəttə ki, yerdən yüzlərlə kilometr uzaqlıqda minlərlə peykə nəzarət edilməsi tamamilə dəqiq olmalıdır. Ümid edək ki, 1 həftəlik bir müddətdə keçirilməsi planlaşdırılan missiya bu həftə müvəffəqiyyətlə həyata keçiriləcək və canlı yayımlarını izləyərik.</p>\r\n<p>“Starlink” layihəsi  haqqında bəs siz nə düşünürsünüz? Fikirlərinizi bizimlə bölüşə bilərsiniz:</p>\r\n<p><a href=\"https://bit.ly/2NkIche\">https://bit.ly/2NkIche</a></p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'starlinkin-ucusu-yeniden-texire-salindi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/18\\/spacex-starlink-misyonu-nu-tekrar-ertelemek-zorunda-kaldi-1558113693.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2230', '96', '2019-05-20 05:31:23', '2019-05-20 05:31:23', 'Galaxy S11 modelinin kod adı açıqlandı', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, Cənubi Koreyanın texnologiya nəhəngi “Galaxy S10” unu bazara təqdim edəndən 3 ay keçməmiş  yeni “Galaxy S11” smartfonu üzərində işlər aparmağa, cihazın kod adı ilə bağlı məlumatları  ictimai media platformalarında elan etməyə başladı.</p>\r\n<p>Əvvəlki modellərdən məlum olduğu kimi “Samsung” smartfonlarında ədəd və rəqəmlərdən ibarət ixtiyari kodların əvəzinə maraqlı kəlimələrə üstünlük verir. “Galaxy S8” üçün “Dream”, “Galaxy S9” üçün “Star” və “Galaxy S10” üçün “Dream” adının seçilməsi bu siyahıya daxildir. Məlumatlara görə “Samsung”un yeni modeli “Galaxy S11”ə “Picasso” adı verilib.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/6c56cecb323cdadb7657e8e96411e75fdeb5acb0.jpeg\" /></p>\r\n<p>İspaniyalı rəssam, heykəltəraş və şair Pablo Pikassonun şərəfinə seçilən bu ad hərkəs tərəfindən yüksək qiymətləndirilib. Yaxın zamanlarda təqdim olunacaq “Galaxy Note 10”un adının \"Da Vinci\" (İntibah dövrü rəssamı Leonardo da Vinci) olacağı gözlənilir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'galaxy-s11-modelinin-kod-adi-aciqlandi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/20\\/6f545c71a9a4137f831b869368f627a6bf23c77f1.jpeg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2231', '96', '2019-05-20 07:30:44', '2019-05-20 07:30:44', 'WhatsApp casus proqramı məhkəməyə verildi', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, kiber kəşfiyyat texnologiya şirkəti olan NSO Group  tərəfindən yaradılan \"Pegasus\" casus proqramının Beynəlxalq Amnistiya işçilərinin məlumatlarını ələ keçirdiyi və insan haqqları müdafiəçilərinə nəzarət etmək üçün istifadə etdikləri iddia olunur.</p>\r\n<p>\"Pegasus\" proqramı “WhatsApp” vasitəsilə mobil telefonlarda idarəetməni ələ keçirir.  Telefonu bir dinləmə cihazına çevirən proqram məlumatları kopyalayır. Ümumilikdə NSO Group kimi şirkətlərin müştəriləri terrorizmə və ciddi cinayətlərə qarşı mübarizə aparmaq istəyən hökumətlərdir. Ancaq casus proqramın yaradılması beyinlərdə bir qədər şübhə yaratdı.</p>\r\n<p>Beləliklə \"Pegasus\" proqram təminatı məhsulun mənfi yöndə istifadəsini həyata keçirməkdə təqsirləndirilir.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/cfd005c7c243f2ea59bbf8d6745e0753a11fde48.jpeg\" /></p>\r\n<p>Beynəlxalq Amnistiya  qurumunun məhkəmədə verdiyi ifadələrə görə casus proqram insan hüquqları müdafiəçiləri üçün xüsusi hazırlanmışdır.</p>\r\n<p>Məhkəmə NSO Groupdan proqramın qanunsuz istifadə istifadəsini həyata keçiridyi üçün ixrac lisenziyasını ləğv etməyi tələb etdi. Məhkəmə ayrıca olaraq “NSO Group”un insan haqqları pozuntularını araşdırmadığını, gözardı etdiyini və məlumatları satmağa davam etdiyini əlavə edib.</p>\r\n<p>Qeyd edək ki, bu NSO Groupun məlumatlara nəzarət eməkdə iddia edildiyi ilk məhkəmə  deyil. “New York Times”in apardığı araşdırmada Səudiyyə Ərəbistan jurnalisti Cemal Kaşıkçının öldürülməsində də \"Pegasus\" proqramının rol oynadığı bildirilir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'whatsapp-casus-proqrami-mehkemeye-verildi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/20\\/whatsapp-tan-bulasan-casus-yazilim-davalik-oldu-1558283479.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2232', '96', '2019-05-20 08:46:40', '2019-05-20 08:46:40', 'Huawei telefonlarında Android və Googledən istifadə məhdudlaşdırılır', '\r\n<p><strong>Chip.az</strong><span> </span>xəbər verir ki, bu səbəbdən yeni “Huawei” telefonları tam quraşdırılmış “Android versiyalarını”, “Google”  proqramları və xidmətlərini dəstəkləməyəcək.</p>\r\n<p>ABŞ və Çin Xalq Respublikası arasında baş verən iqtisadi müharibə mobil texnologiya nəhəngi “Huawei”yə böyük təsiri oldu. Reuters-in verdiyi məlumata görə “Google” dünyanın ən böyük ikinci smartfon istehsalçısı “Huawei” ilə ortaqlığını ləğv etdi.</p>\r\n<p>“Google” və “Huawei”arasında olan bu əməkdaşlıq bütün “Google” avadanlıqları,proqram təminatı və texniki xidmətlərdən istifadəni əhatə edirdi. Ancaq hazırda “Huawei” gələcəkdə satışa təqdim ediləcək smartfonlar üzrə açıq mənbə lisenziyaları olan “Android” versiyaları istisna olmaqla “Android”in tam hüquqlu bir versiyasını istifadə edə bilməyəcək.</p>\r\n<p>Üstəlik “Huawei” telefonlarında “Android” əməliyyat sisteminin rəsmi proqram mağazası Play Store də olmayacaq. Həm də “YouTube” və “Gmail” kimi məşhur xidmətlər əlçatmaz olacaq. “Google” bu qərarı ABŞ-ın “Huawei””ni qara siyahıya əlavə edəndən sonra verdi. Bu qara siyahı “Huawei”nin “Qualcomm”, “Intel” və “Google2 kimi şirkətlərlə iş görməsini maneə törədir. Qərardan sonra “Google” hərəkətə keçən ilk şirkət oldu.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/31f7faa9fc43fb9e4d3ab506775d34bfc007f8ef.jpeg\" alt=\"huawei android\" /></p>\r\n<p>Qərarın Amerika şirkətini “Huawei” ilə əməkdaşlığını əngəlləsə də bütün smartfon sənayesinə təsir göstərə bilər. “Android” əməliyyat sisteminə və “Google” xidmətlərinə daxil olmayacaq “Huawei” telefonlarının Avropa, Asiya və digər bazarlarda satış səviyyəsinin necə olacağı məlum deyil. “Huawei”nin satışının azalması isə digər şirkətlər üçün qapıları açır.</p>\r\n<p>Sonda qeyd etmək lazımdır ki, “Google” və “Huawei” arasında bu fasilənin gələcək “Huawei” smartfonlarına təsir edəcəyi gözlənilir. Mövcud “Huawei” telefonlarının tətbiq yeniləmələri almaq üçün “Google”dən icazə almaq məcburiyyətində deyil. Bundan başqa  “Android” versiya yüksəltmələri və təhlükəsizlik yenilikləri üçün bu keçərli deyil.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'huawei-telefonlarinda-android-ve-googleden-istifade-mehdudlasdirilir', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/20\\/qcv.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2233', '96', '2019-05-20 10:59:25', '2019-05-20 10:59:25', 'Pilotsuz avtomobillər icarəyə veriləcək', '\r\n<p>Buna görə də sözü gedən nəqliyyat vasitələri bağlı olduqları qurğulardakı əməliyyatları həyata keçirə bilərlər. Ekspertlərin fikrincə bu yaxın gələcəkdə tamamilə dəyişəcək.</p>\r\n<p><strong>Chip.az</strong> xəbər verir ki, kirayəlik avtomobillərin müştərilərin ağıllı telefonlarına deyil eyni zamanda  iacrə verən şirkətin sisteminə də bağlı olacağı bildirilir. Sistemə bağlı avtonom nəqliyyat vasitələrinin yanacaq səviyyəsini, şin təzyiqini və yol şəraitini rəhbərə məlumat göndərməsi ilə müştərinin tələbini düzgün şəkildə qarşılaya bilir.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/3266a0fc6ecaabdafdea056396e898190d7c4ab2.jpeg\" /></p>\r\n<p>Avtonom icarə vasitələrinin  istifadə edilmə sahəsinə nümunə olaraq hava limanları göstərilir. Hava limanına sözü gedən avtomobili ilə gələn müştəri vasitəni tərk etdikdən sonar  maşın özü-özünü idarə etmək əmrini alacaq. Daha sonra özünü yanacaqla təmin edə, yuyaraq təmizləyə və növbəti müştərini qəbul etmək üçün yenidən əraziyə qayıdacaqlar.  Sözü gedən  avtomobillərə əlavə olunacaq yeni xüsusiyyətləri ilə, müştərilərə tədricən bahalı və tam avtonom şəkildə təklif olunacağı gözlənilir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'pilotsuz-avtomobiller-icareye-verilecek', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/20\\/otonom-kiralik-araclar-cok-yakinda-geliyor-12065273_o.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
