ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2236', '96', '2019-05-20 12:44:19', '2019-05-20 12:44:19', 'Westworld-un üçüncü mövsümünün fraqmentləri yayımlandı', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Game of Thrones”un son bölümünün yayımlandığı bir vaxtda HBO şirkəti “Westworld”un bu mövsümdəki yeni  fraqmentlərini təqdim etdi. Beləliklə, şirkət HBO xidmətlərinə abunəliyi əldə saxlamaq üçün olduqca yüksək keyfiyyətli görüntülər ilə tamaşaçıların qarşısına şıxdı..</p>\r\n<p>“Westworld” robotların üstünlük təşkil etdiyi fantastik serial olaraq hazırlanıb.  Görüntülərdə qeyri-adi bir gələcək nümayiş olunur.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/5f6f3d89662ae4d6d01d7b23d7725bd3904a0447.jpeg\" /></p>\r\n<p>Video fraqmentlərdə fonda səsləndirilən mahnı diqqət çəkir. Pink Floydun Brain Damage adlı sauntrekinin istifadə olunduğu filmdə Aaron Paulun bu dünyada reallıq axtarışında olduğu müşahidə olunur.</p>\r\n<p>HBO “Westworld”in yeni mövsüm bölümünü 2020-ci ildə yayımlayacaq.</p>\r\n<p><iframe width=\"560\" height=\"314\" src=\"//www.youtube.com/embed/deSUQ7mZfWk\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'westworld-un-ucuncu-movsumunun-fraqmentleri-yayimlandi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"sho