ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2239', '96', '2019-05-21 06:32:29', '2019-05-21 06:32:29', 'Huawei: Honor 20-də heç bir dəyişiklik olmayacaq', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, dünyadakı ən böyük smartfon istehsalçılarından biri “Huawei” günə çox çətin xəbər ilə başladı. ABŞ hökuməti “Huawei”ni qara siyahıya daxil edildikdən sonra “Google”  “Huawei”nin lisenziyasını ləğv etdiyini və xidmətlərindən istifadə edə bilməyəcəyini açıqladı.</p>\r\n<p>ABŞ təşkilatlarının bütün dəstəyindən azad edilən “Huawei\" üçün ölkənin Xarici İşlər Nazirliyindən Vaşinqtona  \"Gözləyin və baxın\" çağırışı edilmişdi. “Huawei”dən verilən açıqlamaya görə Londonda təqdim olunacaq “Honor 20”də heç bir dəyişiklik olmayacaq.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/63f49e06187a9ce37847bf952a42bfb9dfa0a629.jpeg\" /></p>\r\n<p>Çox iddialı açıqlamalar verən “Huawei”belə bir hadisəylə qarşılaşacağlarını təxmin etdiklərini və əldə B planının olduğunu söyləyib. Çinli smartfon sənaye nəhənginin “Google”dən aldığı bu zərbə qarşısında dayanıqlı olacağı və tezliklə sağlam həll yolları tətbiq edəcəyi gözlənilir.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'huawei-honor-20-de-hec-bir-deyisiklik-olmayacaq', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show