ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2240', '96', '2019-05-21 07:07:39', '2019-05-21 07:07:39', 'İT-nəhəngləri 17 ölkə ilə internetdə terror təbliğatı ilə mübarizə aparacaqlar', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, görüş mayın 15-i Parisdə baş tutub. Görüşdə Yeni Zelandiyanın baş naziri Casinda Ardern, onu britaniyalı həmkarı Tereza Mey, Fransa prezidneti Emmanuel Makron, Kanadanın baş naziri Castin Trüdo və başqa siyasətçilər, İT-şirkətlər nümayəndələri olaraq isə “Twitter”-in icraçı direktoru Çek Dorsi, “Facebook”-un beynəlxalq məsələlər üzrə direktoru Nik Kleqq və “Google”-un qlobal kommunikasiyalar üzrə birinci vitse-prezidenti Kent Uolker iştirak edib.</p>\r\n<p>Donald Trampın administrasiyası kommünikeni imzalamaqdan imtina etsə də, Ağ Evin bəyanatında qeyd olunur ki, ABŞ söz və mətbuat azadlığına hörmət edərək, internetdə terroristik məlumatla fəal mübarizəni aparmağa davam edəcək. Bunu ABŞ administrasiyasının bəyanatına istinadla “The Washington Post” qəzeti xəbər verib.</p>\r\n<p><strong>Dünya liderləri nəyə görə ekstremist kontentlə mübarizə aparmağa qərara gəliblər</strong></p>\r\n<p>Sammitin keçirilməsi haqda təşəbbüslə Yeni Zelandiyada 15 martda törədilmiş ən iri terror hücumundan sonra ölkənin baş naziri Casinda Ardern çıxış edib. Xatırladaq ki, Kraystçörçdə iki məscidə silahlı hücum edən terrorçu Brenton Tarrant törətdiyi terror aktınının “Facebook” üzərindən birbaşa canlı yayımını edirdi. Avstraliyalı terrorçu həmçinin “Twitter”-də öz real adı altında qeydiyyatda olduğu hesabında Kraystçörçdəki hücumdan qabaq silahının şəklini dərc etmişdi.</p>\r\n<p>Parisdəki sammit zamanı Ardern İT-şirkətlərinə: “Sizin miqyasınız və təsiriniz (ekstremist kontentlə mübarizəyə görə) üzərinizə məsuliyyət qoyur” , - deyə müraciət edib.</p>\r\n<p>Bəzi ekspertlərin də hesab etdiyi kimi, “Twitter”, “Facebook” və ya “YouTube” kimi populyar sosial şəbəkələr təbliğat işində “ucluq” qismində çıxış edirlər. Özü də terrorçular kommunikasiya üçün kompüter oyunlarındakı çatlara qədər digər messencer və bloqlardan da fəal şəkildə faydalanırlar.</p>\r\n<p><strong>Terrorizmlə mübarizədə hansı təşəbbüslər təklif olunur</strong></p>\r\n<p>Yekun kommünikeni 17 ölkə nümayəndəsi (adı sadalananlardan başqa Avstraliya, Almaniya, Hindistan, İtaliya, Niderland, İspaniya və İsveç) və İT-şirkətlər imzalayıb. Razılaşdırılmış sənədin hüquqi qüvvəsi yoxdur. Sadəcə imzalanmış dövlətlərin hakimiyyətləri terrorizmin başlıca səbəblərindən qurtulmaq üçün öz ölkələrindəki cəmiyyətlərin birləşdirilməsi üçün əlavə səylərini göstərməyə söz veriblər. İT-şirkətlər isə üzərinə ekstremist kontentlə mübarizədə əlavə “konkret və şəffaf tədbirlər” götürməyi, həmçinin istifadəçilərin radikal qruplardan məlumat əldə etməməsi üçün labüd alqoritmlərin tərtib edilməsi öhdəliklərini götürüblər.</p>\r\n<p><strong>İstifadəçilər nə gözləməlidir</strong></p>\r\n<p>Paris razılaşmaları, ekspertlərin qeydlərinə görə, dövlətlərin onlayn-kontent üzərindəki nəzarətinin gücləndirilməsinin sübutudur. Onların fikrincə, smartfon istehsalçıları, tətbiq yaradıcıları artıq hakimiyyətlərlə fəal əməkdaşlıq edirlər, özü də çox vaxt səssiz və gizli şəkildə. Hakimiyyətin internetdə tənzimləyici rolunun gücləndirilməsinin nəticəsi özəl şirkətlərə dövlət orqanları tərəfindən edilən sorğuların artması olacaq.</p>\r\n<p>Tənzimləmənin sərtləşdirilməsi istifadəçilərə də toxunacaq: qanunvericilk tələblərinin sərtləşdirilməsi boyu artıq şəxsi həyatın toxunulmazlığı, məxfilik, şəxsi yazışma, telefon danışıqları, poçt və digər ismarışların sirri kimi anlayışları unutmaq olar.</p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'it-nehengleri-17-olke-ile-internetde-terror-tebligati-ile-mubarize-aparacaqlar', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/21\\/755579468877815.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2241', '96', '2019-05-21 08:03:53', '2019-05-21 08:03:53', 'Sony yeni naqilsiz qulaqlıqlarını təqdim etdi', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Sony”nin istehsal etdiyi bir çox modeli olmasına baxmayaraq ekstra bass özəllikli  əlavə naqilsiz qulaqlıqları istifadəçilərin ən çox müraciət etdiyi məhsuldur. Eyni zamanda bazarda ən çox satılan məhsullardan biridir. Yeni simsiz qulaqlıqları ilə Sony bir daha fərqini bsübut etdi. Şirkətin yeni naqilsiz qulaqlıq modeli WH-XB900N;</p>\r\n<p>WH-XB900N-in texniki detalları:</p>\r\n<p>Naqilsiz qulaqlıqlar ekstra bass və küyü ləğv etmə xüsusiyyətinə malikdir. 30 saata qədər istifadəyə imkan verir. Smartfonlarda mövcud olan Google Now və Siri kimi köməkçiləri ilə optimallaşdırılaraq rahatlıqla istifadə edilə bilir. Bundan başqa qulaqlıqların üzərində nəzarəti həyata keçirmək üçün əlaqə zonası da var.</p>\r\n<p>WH-XB900N avqust ayında qara və mavi rənglərdə satışa təqdim ediləcək. Məhsulun qiyməti 278 dollardır. (təxminən 473,99 AZN)</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'sony-yeni-naqilsiz-qulaqliqlarini-teqdim-etdi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/21\\/sonyy.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2242', '96', '2019-05-21 08:42:58', '2019-05-21 08:42:58', 'Huawei problemində Azərbaycan üçün təhlükə varmı?', '\r\n<p><strong>Bir neçə gündür ki, Huawei şirkəti ABŞ sanksiyaları ilə üzləşib. ABŞ onu telefonlardakı proqram təminatlatında yerləşdirdiyi xüsusi kodlar vasitəsilə məlumatları oğurlamaqda və Çin hökumətinə ötürməkdə günahlandırır. Ümumiyyətlə uzun illər idi ki bu şirkətin Çin hökuməti ilə iş birliyində olduğu bildirilirdi. Huawei-in milyardlarla marketinq siyasəti və ucuz məhsul satması da hökumətin dəstəyilə olduğu bildirilirdi. Şirkət də bunu təkzib edirdi. Belə görünür ki ABŞ hökuməti artıq bunu isbat edib\"</strong></p>\r\n<p><strong>Chip.az</strong><em><strong> </strong></em>xəbər verir ki, bu sözləri Azərbaycan İnternet Forumunun prezidenti, İKT sahəsi üzrə ekspert Osman Gündüz bildirib. Ekspert mövcud vəziyyətin Azərbaycan üçün hansı təhlükələr yaradacağı haqqında da danışıb :</p>\r\n<p><strong>İndi nə baş verəcək?</strong></p>\r\n<p>Bu məsələ əslində 5G reallaşanda gündəmə gəldi. Yəni məlumat oğurluğu məsələsi zaman-zaman digər qlobal şirkətlərdə (FB, Apple, Google və s.) də olub.<br />Amma 5G gündəmə gələndən sonra məlum oldu ki, belə davam edərsə Huawei öz avadanlıq və proqramları ilə, hədsiz böyük məlumat ötürmə sürətilə bütün əşyaları inteqrasiya edə biləcək, bir sözlə 2-ci bir real dünyamıza nəzarət edəcək. Odur ki, ABŞ təhlükəsizlik baxımından buna imkan verə bilməzdi. Güman ki, bundan sonra Huawe-nin global dünyada hökmranlığına son qoyulacaq və hansısa cərimələr və açıqlamalarla N-ci sırada olan bir şirkətə çevriləcək.</p>\r\n<p><strong>Azərbaycan üçün təhlükə varmı?</strong></p>\r\n<p>Bəli var. Bizdə dövlət sektorunda Huawei-nin xüsusi çəkisi yetərincədir. Ucuz olduğu üçün bəzi dövlət qurumları bu şirkətin sistemlərinə üstünlük verib. Bildiyim qədər BakTelecomun (BTRİB) 80% - i, Aztelekom 70%-i, hətta bəzi dövlət qurumlarının Data Mərkəzləri Huawei məhsulları üzərində oturub. Sanksiyalar hələlik Huawei telefonlarla bağlıdır. Əgər sabah ABŞ sanksiyaları Huawei bütün avadanlıqlarına və proqramlarına şamil olunarsa nə baş verəcək?Təsəvvür etmək çox çətindir.</p>\r\n<p><strong>Azərbaycan informasiya sahəsində çox ciddi təhdidlərlə üzləşə bilər.</strong></p>\r\n<p>Xatırlayıram ki, NRYTN yeni qurduğu Data Mərkəz də az qala Huawei-ni nəzarətinə keçirdi. Son anda BestComp şirkətinin çevik siyasəti ilə bu məsələ sovuşub.</p>\r\n<p><strong>Nə etməli?</strong></p>\r\n<p>Düşünürəm ki, bu hadisədən sonra XDMX bütün dövlət İT sektorunu monitorinq və audit etməlidir. Bildiyim qədər bizdə Huawei ilə daha çox əməkdaşlıq edən Eurodesign və Ultra şirkətləri olub. Sanksiyalarla əlaqəli gözlənilən Huawei təhlükələrindən yayınmaq üçün hökumət təcili B planı hazırlamalıdır.</p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'huawei-probleminde-azerbaycan-ucun-tehluke-varmi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/21\\/10535.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2243', '96', '2019-05-21 11:09:54', '2019-05-21 11:09:54', 'Far From Home-nin fraqmentləri bəzi detalları təsdiqlədi', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Far From Home” filmi üçün yayımlanan qısa bir giriş videosunda Marvel tamaşaçılara böyük bir ipucu vermiş oldu. Yeni təqdim olunan videoda əvvəlki fraqmentlərdə işarə olunan mühüm bir hadisə öz təsdiqini tapdı.</p>\r\n<p>Bu qısa videoda Mary Janenin, Peter Parkerin Spider-Man olduğunu öyrəndiyini görürük. Videonu aşağıdakı linkdən izləyə bilərsiniz:</p>\r\n<p><a href=\"https://bit.ly/2VPEVOC\">https://bit.ly/2VPEVOC</a> </p>\r\n<p><strong><em>\"- Bilir, ona dedim.</em></strong></p>\r\n<p><strong><em>+ O demədi, tapdım\"</em></strong></p>\r\n<p>Yəni Mary Janenin Peterin Spider-Man olduğunu öyrəndiyini başa düşürük. Qalan hər şeyi necə öyrənməsini isə filmə baxaraq anlamaq mükündür.</p>\r\n<p>“Far From Home” bildiyiniz kimi Avengers : Endgame sonra baş verən hadisələri işləyəcək. İlk olaraq Peterin Toni üçün necə darıxdığını, sonra isə bütün olanları geridə qoymaq üçün sinif yoldaşları ilə tətilə çıxdığını görəcəksiniz. Əlbəttə Peter ilk filmdə olduğu kimi rahat olmayacaq, çünki bu dəfə başında  Nick Fury olacaq. Jake Gyllenhaalın Marvel kainatına Mysterio olaraq daxil olması pərəstişkarları çox həyəcanlandırdı.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'far-from-home-nin-fraqmentleri-bezi-detallari-tesdiqledi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/21\\/spider-man-far-from-home-fragmani-onemli-bir-12068981_o.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2244', '96', '2019-05-21 12:05:22', '2019-05-21 12:05:22', 'TikTok-un sahibi Feiliao adlı yeni proqram hazırladı', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, bəzilərinin çox sevdiyi digərlərinin isə qəbul etmədiyi  TikTok proqramının istehsalçısı Feiliao forum və birbaşa mesaj xüsusiyyətlərini birləşdirən yeni sosial media tətbiqini istifadəyə verdi. Feiliao (ingiliscə Flipchat) App Store-da sosial media tətbiqi kimi tanınır. İstifadəçilər münasibətlərdən tutmuş populyar TV seriyallarına qədər müxtəlif mövzularda söhbətlər edə bilərlər.</p>\r\n<p><img src=\"https://techcrunch.com/wp-content/uploads/2019/05/18851558317865_.pic_hd.png?w=680\" /></p>\r\n<p>“Feiliao”da iki növ söhbət qrup var: açıq və normal qruplar. Normal qruplar forum üslubunda  işləyir. Bir çox insanlar bir mövzu ətrafında öz fikirlərini ifadə edə bilər. Və qrup üzvlərinin sayına məhdudiyyət tətbiq olunmur. Normal qruplar isə özəl söhbətlər qruplarıdır. Eyni zamanda 100 istifadəçi məhdudiyyətinə malikdir. Bundan əlavə, qrup təsisçiləri avtomatik olaraq idarəçi olur və qrupdakı üzvlərə moderatorluq verə bilirlər.</p>\r\n<p>Proqramın istifadəyə verilməsi  hələ erkən mərhələdə olduğundan App Store-dan tətbiqi yükləmək bir az çətindir. Axtarışa “Feiliao” açar sözünü yazdıqda Bytedancenin tətbiqetməsi birbaşa siyahıda çıxmaya bilər. Tətbiqi görmək üçün “Feiliao Xingqu” kəliməsini axtarışa vermək lazımdır.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'tiktok-un-sahibi-feiliao-adli-yeni-proqram-hazirladi', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/21\\/tii.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2245', '96', '2019-05-21 13:05:33', '2019-05-21 13:05:33', 'Kriptovalyuta qazanmaq üçün ən yaxşı 6 oyun', '\r\n<p>Əlbətdəki bu pullar ferrari almağa kifayət etməyəcək lakin gedib bahalı avadanlıqları alıb kriptovalyuta mayninq etməkdənsə oyun oynayaraq kriptovalyuta qazanmaq daha faydalıdır. Blockchain texnologiyası əsasında yaradılan oyunları oynamaqla siz bitcoin, ethereum və digər kriptovalyutaları qazana bilərsiz.</p>\r\n<p><strong>Chip.az</strong> xəbər verir ki, bəzi oyunlar var ki, onlar üçün Windows və ya MacOS əməliyyat sistemli kompüter lazım olacaq, digərlər oyunlar üçün isə Android və ya iOS sistemli smartfonlar kifayət edir. Hazırda mövcud olan 6 ən populyar oyunlarə sizə təqdim edirik:</p>\r\n<p><a href=\"https://huntercoin.org/\" target=\"_blank\" rel=\"noopener noreferrer\">Huntercoin</a><span> </span>– Bu oyunda istifədəçilər oyunun gedişindən aslı olaraq<span> </span><a href=\"https://coinmarketcap.com/currencies/huntercoin/\" target=\"_blank\" rel=\"noopener noreferrer\">HunterCoin</a>tokenləri qazanırlar. Elə də məşhur olmayan bu tokenləri Poloniex birjasında BTC-yə rahatlıqla mübadilə etmək olur.</p>\r\n<p><a href=\"https://steemmonsters.com/\" target=\"_blank\" rel=\"noopener noreferrer\">Steem Monsters</a><span> </span>– Oyun Steem blockchain-i əsasında qurulub və oyunçular mükafat olaraq<span> </span><a href=\"https://coinmarketcap.com/currencies/steem/\" target=\"_blank\" rel=\"noopener noreferrer\">Steem</a><span> </span>və Steem dollar alırlar.</p>\r\n<p><a href=\"https://play.google.com/store/apps/details?id=com.cakecodes.bitmaker&amp;hl=ru\" target=\"_blank\" rel=\"noopener noreferrer\">Storm Play</a><span> </span>– Oyunda istifadəçilər hər bir mərhələni bitirdikdə platformanın daxili valyutası olan Bolts qazanırlar. Sonrdan bu valyutanı BTC, ETH və<span> </span><a href=\"https://coinmarketcap.com/currencies/storm/\" target=\"_blank\" rel=\"noopener noreferrer\">Storm</a>mübadilə etmək olur.</p>\r\n<p><a href=\"https://www.worldopo.io/ru\" target=\"_blank\" rel=\"noopener noreferrer\">Worldopo</a><span> </span>– Oyun Google Maps və Open Street Maps data məlumatlarını istifadə edir ki, oyunçular dünya üzrə real yollar ala bilsinlər. İstifadəçilər oyunda mükafat olaraq BTC, ETH və Worldopo (WPT) qazanmaq imkanı qazanır.</p>\r\n<p><a href=\"https://sweatco.in/\" target=\"_blank\" rel=\"noopener noreferrer\">Sweatcoin</a><span> </span>– Bu oyunu idmanla məşğul olanlar üçün daha sərfəli olacaq. Mobil tətbiqi smartfona yükləyirsiz və hər 1000 addımınız üçün sizə  Sweatcoin (SWC) hədiyye edilir. Düzdür bu tokeni heç bir birjada digər kriptovalutalara mübadilə etmək olmur lakin bu tokenlər ilə elektron kitablar və iPhone (o qədər gəzə biləsz) almaq mümkündür.</p>\r\n<p><a href=\"https://privateers.life/\" target=\"_blank\" rel=\"noopener noreferrer\">Privateers.Life: The Island</a><span> </span>– Oyun dəniz quldurları mövzusuna həsr edilib və hər bir istifadəçi mükafat olaraq platformanın daxili tokeni olan Ludum (LDM) alırlar. LDM tokenlərini isə<span> </span><a href=\"https://etherdelta.com/#LDM-ETH\" target=\"_blank\" rel=\"noopener noreferrer\">EtherDelta</a><span> </span>birjasında mübadilə etmək mümkündür.</p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'kriptovalyuta-qazanmaq-ucun-en-yaxsi-6-oyun', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/21\\/0_qX0_-0oK-qJc__SR_.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2246', '96', '2019-05-21 13:39:30', '2019-05-21 13:39:30', 'MacBook-u belə şarj edəcək Powerbank hazırlanıb', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, “Hyper” yeni 2HyperJuice” 130 W-luq yeni portativ batareya cihazını təqdim etdi. Yeni “HyperJuice” batareyası iki USB-C bağlantı nöqtəsi ilə gəlir. Bunlardan biri 100 W çıxışı təmin edə bilər. Bu yolla “HyperJuice” hətta “Apple” noutbuklarını belə enerji ilə təmin edə bilər.</p>\r\n<p>“MacBook Pro” və “iPad Pro2nu eyni anda maksimum sürətlə doldura bilən batareyanın istehsalçısı bunun dünyada həyata keçirilən bir ilk olduğunu bildirib. “HyperJuice” ümumi olaraq 27.000 mAh tutumuna sahibdir. Batareya təyyarədə istifadə oluna biləcək tərzdə hazılanıb.</p>\r\n<p><img src=\"https://www.webtekno.com/images/editor/default/0002/03/420eec975693d058160e8014b0ce8e5ac23376e2.jpeg\" /></p>\r\n<p>“HyperJuice” gümüşü və boz rəngdə olmaqla “Apple” məhsullarına tam uyğun şəkildə hazırlanıb. 112 W güc adaptoru sayəsində “HyperJuice” yalnız bir saat ərzində şarj edilərək eyni anda digər cihazları da doldurmağa davam edə bilər.</p>\r\n<p>“HyperJuice” 250 dollara təklif olunur.</p>\r\n<p style=\"text-align: right;\"><strong>Aida İSAQ</strong></p>', 'macbook-u-bele-sarj-edecek-powerbank-hazirlanib', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/21\\/macbook-u-bile-sarj-eden-27-000mah-kapasiteli-powerbank-1558382063.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
ERROR - 2019-05-23 09:56:19 --> Query error: Column 'hit' cannot be null - Invalid query: INSERT INTO `news_content` (`id`, `catid`, `created`, `publish_up`, `az_title`, `az_text`, `az_slug`, `attribs`, `hit`, `active`, `created_by`) VALUES ('2247', '96', '2019-05-22 05:44:28', '2019-05-22 05:44:28', 'Kibertəhlükəsizlik üzrə Gənclər Seminarı keçirilib', '\r\n<p><strong>Chip.az</strong> xəbər verir ki, məqsəd kibertəhlükəsizlik sahəsində maarifləndirmə səviyyəsinin artırılması və ümummilli hazırlığın yüksəldilməsi, kiberfəzada Azərbaycan Respublikasının təhlükəsizliyinin təmin edilməsində gənclərin daha da fəal iştirakının stimullaşdırılmasıdır. Tədbir iki sessiyadan ibarət idi.</p>\r\n<p>Seminarın birinci sessiyasında Nəqliyyat, Rabitə və Yüksək Texnologiyalar Nazirliyinin Elektron Təhlükəsizlik Xidməti tərəfindən \"Kibermühitdə təhdidlər, hücumlar və müdafiə yolları\" mövzusunda və \"Azercell Telecom\" MMC tərəfindən \"Fraud\" ilə bağlı məlumatlılıq\" mövzusunda məruzələr dinlənilib.</p>\r\n<p>Seminarın ikinci sessiyasında \"Microsoft Azərbaycan\" şirkəti tərəfindən \"Müasir kibertəhlükəsizlik\" mövzusunda, \"Penteston\" şirkəti tərəfindən isə \"Serverdə təhlükəsizlik/Serversiz dünya\" mövzusunda məruzələrlə çıxışlar edilib.</p>\r\n<p>Tədbirdə gənclər gündəlik istifadə etdikləri qurğuların kibertəhlükələrdən mühafizəsi, onlara proqramların quraşdırılması, loqin və parolların kibermüdafiəsi, məlumatı avtomatik təsnifləmək, şifrləmək, təhlükəsiz paylaşma üsulları haqqında məlumatlandırılıb. Onlar informasiya sistemlərinə edilən müdaxilələrin qarşısının alınması ilə bağlı maarifləndirilib və kiberhücumların nəticələri, təhlükəsizlik tədbirləri haqqında danışılıb. Bildirilib ki, ziyanverici proqramlar hədəf qurğularda məlumatları oğurlamaq, silmək, sistemi sıradan çıxarmaq, işi ləngitmək xüsusiyyətinə malikdir.</p>\r\n<p>Təqdimatla çıxış edən mütəxəssislər ilə gənclər arasında eyni zamanda praktik məsələlərə əsaslanan kibertəhlükəsizlik həlləri üzrə interaktiv sual-cavab sessiyası təşkil olunub. Müzakirələrdə ictimai fəal gənclər və gənclər təşkilatlarının məsul nümayəndələri iştirak ediblər.</p>\r\n<p>Məlumat üçün bildirək ki, \"Kibertəhlükəsizlik üzrə Gənclər Seminarı\" Azərbaycan Respublikası Prezidentinin müvafiq sərəncamları ilə təsdiq edilmiş \"2015-2025-ci illərdə Azərbaycan gənclərinin İnkişaf Strategiyası\", \"Azərbaycan Respublikasında informasiya cəmiyyətinin inkişafına dair 2014-2020-ci illər üçün Milli Strategiya\" və \"Azərbaycan Respublikasında informasiya cəmiyyətinin inkişafına dair Milli Strategiyanın həyata keçirilməsi üzrə 2016-2020-ci illər üçün Dövlət Proqramı\", eləcə də \"Azərbaycan 2020: gələcəyə baxış\" İnkişaf Konsepsiyası\"nda kibertəhlükəsizlik, habelə gənclərin maariflən<span>dirmə səviyyəsinin artırılması sahəsində qarşıya qoyulmuş vəzifələrdən irəli gələn məsələlərin həlli üzrə reallaşdırılır.</span></p>\r\n<p style=\"text-align: right;\"><strong>Chip.az</strong></p>', 'kibertehlukesizlik-uzre-gencler-seminari-kecirilib', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"spfeatured_image\":\"images\\/2019\\/05\\/22\\/1111.jpg\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', NULL, '1', '971')
